(13, 7, NULL, 'DKM ASH - AHIDIQIIN / H. MOH SODIKIN', 'DKM ASH - AHIDIQIIN', 'kegiatan DKM DKM ASH - AHIDIQIIN untuk membangun dan memperbaiki sarana tempat ibadah.', 'sebagai sarana peribadatan dan pendidikan agama yang reprentatif, membawa masyarakat dalam ', 'Jl. Jamika Kp. Pasirkoja Rt.002/Rw.005 Kelurahan Sukahaji Kecamatan Babakan Ciparay Bandung / Jl. Terusan Jamika Gg. Mama Dipa RT.02/05 Kelurahan Sukahaji Kecamatan Babakan Ciparay / 085316195465', '57f6362738f23886f4a72a90073e6b2c.pdf', NULL, NULL, 1, NULL, '2014-03-30 17:00:00', NULL, 2),
(14, 7, NULL, 'ASEP SUDARMA ADJIE ', 'BKM HANIFA ', 'Program Kegiatan Sosial BKM Hanifa Tahun 2014', 'Pelaksanaan Program Kegiatan DDUB PNPM-MP Reguler dan Pengembangan PNPM-MP BKM Hanifa Tahun 2014', 'Jl. Bbk Wadana 152 Cipamokolan Rt. 005 Rw. 008 Kel. Cipamokolan Kec. Rancasari', 'f532174b070a8f794c48887a92d881ec.pdf', 'd1cb943c180d0d889265398155894f84.pdf', NULL, 2, 4, '2014-03-30 17:00:00', NULL, 7),
(15, 7, NULL, 'PANITIA CIBIRU HIJAU / WAWAN SETIAWAN', 'PANITIA CIBIRU HIJAU', 'kegiatan PANITIA CIBIRU HIJAU (PCH) dalam pembibitan tanaman keras', 'memberikan pemahaman kepada masyarakat akan pentingnya pohon bagi kehidupan dan juga dengan harapan dapat menciptakan kegiatan yang bersifat ekonomis.', 'Cigagak RT. 002 RW. 014 Kel. Cipadung Kec. Cibiru Kota Bandung / Cigagak RT. 02 RW. 13 Kel. Cipadung Kec. Cibiru Kota Bandung / 081313197909', '6329d07eb62193d969d43ed5dd12afa3.pdf', '32911c7570bd21fe53273fa49e09d636.pdf', NULL, 1, 19, '2014-03-30 17:00:00', NULL, 4),
(16, 7, NULL, 'SUDRADJAT NANDANG AANG ', 'BKM MEKAR ARUM ', 'Program Kegiatan Sosial BKM Mekar Arum Tahun 2014', 'Pelaksanaan Program Kegiatan DDUB PNPM-MP Reguler dan Pengembangan PNPM-MP BKM Mekar Arum Tahun 2014', 'Jl. Mh. Syarif No.49 Rt 03 Rw 06 Kel. Karang Pamulang Kec. Mandalajati Bandung', 'e189a2255be15fe7cc9b3a31caa94660.pdf', '188a15672ba78c429f31ad6c7f8042f6.pdf', NULL, 2, 4, '2014-03-30 17:00:00', NULL, 7),
(17, 7, NULL, 'SUDIYO', 'BKM PAGUYUBAN MASYARAKAT PASIR ENDAH (PMPE)', 'Program Kegiatan Sosial BKM Paguyuban Masyarakat Pasir Endah (PMPE) Tahun 2014', 'Pelaksanaan Program Kegiatan DDUB PNPM-MP Reguler dan Pengembangan PNPM-MP BKM Paguyuban Masyarakat Pasir Endah (PMPE) Tahun 2014', 'Cijambe Kulon Rt 004 Rw 001 Kel. Pasir Endah Kec. Ujungberung', '21c6bea65171b21a3676b23eef7533c5.pdf', '73b2ec0cd9647e58cd30246cf3057d9d.pdf', NULL, 2, 4, '2014-03-30 17:00:00', NULL, 7),
(18, 7, NULL, 'SASMITO PANGADI ', 'BKM SUKAPADA', 'Program Kegiatan Sosial BKM Sukapada Tahun 2014', 'Pelaksanaan Program Kegiatan DDUB PNPM-MP Reguler dan Pengembangan PNPM-MP BKM Sukapada Tahun 2014', 'Bbk Baru Rt 005 Rw 011 Kel. Sukapada Kec. Cibeunying Kidul', '11776dbcd2c33249da17b9baf3608f53.pdf', '5c785dc2ebd09d30fe0abbbb08e77303.pdf', NULL, 2, 4, '2014-03-30 17:00:00', NULL, 7),
(19, 7, NULL, 'KELOMPOK USAHA BERSAMA “WALATRA” / HERI A, STP', 'KELOMPOK USAHA BERSAMA “WALATRA"', 'kegiatan KELOMPOK USAHA BERSAMA “WALATRA” dalam kegiatan kelompok usaha bersama Walatra', 'merubah pola pikir dari mencari pekerjaan menjadi menciptakan lapangan kerja disektor informal, untuk memanfaatkan Sumber Daya Alam (SDA) yang ada sumber pakan ternak dan untuk membuka unit kelompok binaan pada wirausaha tersebut diatas', 'Jl. HJ Rohmah I No. 62 Rt.08/ Rw.15 Kel. Babakan Surabaya Kec. Kiaracondong Kota Bandung /022-93717578', '49a3d6d89e4370a9c4b9c869f145e245.pdf', 'e06c3b8a14be17010a9f3ea175004ac5.pdf', NULL, 1, 19, '2016-03-30 17:00:00', NULL, 5),
(20, 7, NULL, 'KODIM 0618/BS / RUDY MOHAMAD RAMDHAN', 'KODIM 0618/BS', 'Program KODIM 0618/BS', 'Kegiatan TNI Manungggal membangun Kelurahan (TMKK), Bakti Siliwangi Satata Sariksa, KB Kesehatan Terpadu, Gerakan Kebersihan, Karya Bakti, insentif Pejabat Apkowil, Pengamanan Idul Fitri, Pengamanan VVIP, Pengamanan Natal dan Tahun Baru, Patroli Pengamanan Wilayah kediaman pejabat VVIP dan objek vital Nasional, dan penanggulangan bencana tahun 2014. Tujuan : pedoman dalam penyelenggaraan kegiatan Pembinaan Teritorial tahun 2014 di wilayah Kodim 0618/BS.', 'JL. GUDANG UTARA BANDUNG/JL. BANGKA NO. 2 BANDUNG', 'e20c40de164a4296fba6eafbde20326a.pdf', 'dfa959e7331a1a9ee7a98068ed2503d6.pdf', NULL, 1, 4, '2014-03-30 17:00:00', NULL, 4),
