(194, 7, NULL, 'Panitia Pembangunan Madrasah Diniyah Sabilul Huda - Ketua - Jajang Syaripudin', 'PANITIA PEMBANGUNAN MADRASAH DINIYAH SABILUL HUDA KOTA BANDUNG TAHUN 2015', 'Program Kegiatan Panitia Pembangunan Madrasah Diniyah Sabilul Huda Tahun 2015', 'Untuk membantu masyarakat dan pemerintah dalam memahami memperdalam sekaligus mengamalkan ajaran Islam khususnya dalam bidang dakwah dan pendidikan sosial kemasyarakatan sebagai upaya mewujudkan bangsa dan negara yang makmur atau dengan kata lain Baldatun Toyyibatun Wa Robbun Gofur, meningkatkan pelayanan dan mutu pendidikan melalui pengembangan situasi dan lingkungan yang lebih layak, merespon dan memelihara kepercayaan masyarakat yang meningkat dan mengagungkan syiar agama Alloh', 'Jl. Nagrog Atas Kp. Ciwaru RT. 04 RW. 12 Kel. Pasanggrahan Kec. Ujungberung Kota Bandung / 081322215082', 'b6e9ceb6b849a5dc779af34f9d8f0b1c.pdf', '9b7a2dbcb24461722b12fd894548527c.pdf', NULL, 1, 9, '2014-02-27 17:00:00', NULL, 7),
