(196, 7, NULL, 'Yayasan Ponpes Hidayatul Mubtadiin - Ketua - K.H. Dedi Supriyadi', 'YAYASAN PON PES HIDAYATUL MUBTADIIN KOTA BANDUNG TAHUN 2015', 'Program Kegiatan Yayasan Ponpes Hidayatul Mubtadiin Tahun 2015', 'Untuk  mewujudkan lembaga Pendidikan Islam yang unggul dan kompetitif hingga dapat melahirkan generasi muslim muslimah yang memiliki kemampuan memikul amanah Allah sebagai hamba kholifahnya, menyelenggarakan lembaga pendidikan Islam dengan system integral yang memadu aspek intelektual, mental spiritual dan life skill sehingga dapat melahirkan generasi muslim bertagwa cerdas dan mandiri dan mengangkat pakir miskin agar tetap bias meneruskan cita-citanya dan terhindar dari kekholifanya.', 'Jl. Cicukang Kidul No. 6 RT. 03 RW 08 Kel. Cisaranteun Binaharapan Kec. Arcamanik Kota Bandung / Jl. Cicukang Kidul No. 6 RT. 03 RW 08 Kel. Cisaranteun Binaharapan Kec. Arcamanik Kota Bandung / 085324277778', 'cbb60bd937d712c86c51fb8132a0dd37.pdf', '0b86046fbcd42430003bd89e750880cf.pdf', NULL, 1, 9, '2014-02-27 17:00:00', '2016-01-11', 7),
