(214, 7, NULL, 'MDA AL-IHSAN / DEWI MASPUPAH', 'MDA AL-IHSAN / DEWI MASPUPAH', 'Kegiatan DTA Al-Ihsan dalam mempertahankan dan meningkatkan kualitas proses pembelajaran dan meningkatkan tingkat kesejahteraan pendidik dan tenaga kependidikan.dan terpenuhinya sarana prasarana yang dibutuhkan', 'Kegiatan DTA Al-Ihsan dalam mempertahankan dan meningkatkan kualitas proses pembelajaran dan meningkatkan tingkat kesejahteraan pendidik dan tenaga kependidikan.dan terpenuhinya sarana prasarana yang dibutuhkan', 'Gg. Manunggal II C RT 04 RW 10 Kel. Cijerah Kec. Bandung Kulon / Jl. Jend. Sudirman Gg. Manunggal II C RT. 03 RW. 10 Kel. Cijerah Kec. Bandung Kulon / 082110854220', '1a72e0162553173d15e60940c1afa4bc.pdf', 'd2646f2085a57d3cdce6ff5de92fea39.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(215, 7, NULL, 'PENGADAAN SAB DAN PIPANISASI RW 10/JUMADI', 'PENGADAAN SAB DAN PIPANISASI RW 10', 'Pengadaan sarana air bersih dan pipanisasi di RW.10 Kelurahan Pasanggrahan Kecamatan Ujungberung Bandung.', 'Bertujuan untuk mengoptimalisasi penyediaan pelayanan air bersih bagi masyarakat di sekitar Kelurahan Pasanggrahan pada saat musim kemarau, dan membantu Pemerintah dalam pemerataan pembangunan khusus pengadaan penyediaan air bersih.', 'Sekedangdeur RT.002/010 Kel Pasanggrahan Kec Ujungberung', '01c9c0a55dd193113704e6abc250e5cc.pdf', 'dce5c4a95c5a3c446d33dfd459cece5e.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
(216, 7, NULL, 'MDA NURUL IHSAN / MAEMANAH', 'MDA NURUL IHSAN / MAEMANAH', 'kegiatan MDA NURUL IHSAN dalam melengkapi sarana dan prasarana, memberikan gambaran riil tentang kebutuhan biaya, penyelenggaraan pendidikan di Madrasah Diniyah Awaliyah (MDA) Nurul Ihsan Kel. Cibuntu Kec. Bandung Kulon Kota Bandung dan mempertahankan serta meningkatkan kualitas proses pembelajaran dan meningkatkan tingkat kesejahteraan pendidik dan tenaga kependidikan', 'kegiatan MDA NURUL IHSAN dalam melengkapi sarana dan prasarana, memberikan gambaran riil tentang kebutuhan biaya, penyelenggaraan pendidikan di Madrasah Diniyah Awaliyah (MDA) Nurul Ihsan Kel. Cibuntu Kec. Bandung Kulon Kota Bandung dan mempertahankan serta meningkatkan kualitas proses pembelajaran dan meningkatkan tingkat kesejahteraan pendidik dan tenaga kependidikan', 'Jl. Soekarno Hatta No. 65/80 Rt. 03 Rw. 02 Kel. Cibuntu Kec. Bandung Kulon Kota Bandung/Jl. Soekarno Hatta Rt. 01 Rw. 02 Kel. Cibuntu Kec. Bandung Kulon Kota Bandung / 085795541240', '6b0967bba8db72557be57aab63f5a190.pdf', 'c5ce0235100f1201cf23d4755ec73383.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
