(219, 7, NULL, 'DKM ISTIQLAL/H. RUCHIYAT', 'DKM ISTIQLAL', 'Dipergunakan untuk kegiatan DKM ISTIQLAL dalam membina kaum muslimin dan muslimat untuk bertaqwa kepada Allah SWT, sehingga menjadi warga Negara Republik Indonesia yang mengamalkan Pancasila.', 'Bertujuan untuk : membina kaum muslimin dan muslimat untuk bertaqwa kepada Allah SWT, sehingga menjadi warga Negara Republik Indonesia yang mengamalkan Pancasila dan mewujudkan aspirasi kaum muslimin dan muslimat di Rukun Warga 04 khususnya masyarakat sekitarnya yang membutuhkan sarana Ibadah.', 'Jl. Cipedes II No. 18 RT.03-RW.04 Kel. Pajajaran Kec. Cicendo Bandung/ Jl. Cipedes II No. 18/182B RT 03. Rw. 04 Kel. Pajajaran Kec. Cicendo Bandung/ 022-6078634/081809855010', '3101867a46a9f658d41fe4ec8c036d6f.pdf', 'e8f14a55ca7c9de615214112a8fc0501.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7);
