(311, 7, NULL, 'DTA AL-IKHLAS / OHAN. DRS - KETUA', 'DTA AL-IKHLAS', 'Kegiatan Progam DTA AL-IKHLAS Tahun 2014', 'Progam DTA AL-IKHLAS Tahun 2014 Tujuan dapat memenuhi dan memfasilitasi kegiatan belajar mengajar di DTA agar seluruh rangkaian kegiatan dapat berjalan dengan baik dan memberikan motivasi kepada pendidikan/guru untuk lebih bersemangat dalam mengasuh santri', 'Sindangsari I Gg. Mekarsari 5 Rt. 03/08 Kel. Antapani Wetan Kec. Antapani Kota Bandung/ Jl. Sindangsari I Rt. 05/08 Kel. Antapani Wetan Kec. Antapani Kota Bandung', '54d0da7af3437a1b6ef362d00ea06a45.pdf', '323cc44499af5f053a0aa56f03d2c7da.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(312, 7, NULL, 'PEMUDA PEMUDI SENI RW.05 SEKELOA / ANNAS NASRUDDIN - KETUA', 'PEMUDA PEMUDI SENI RW.05 SEKELOA', 'Program kegiatan PEMUDA PEMUDI SENI RW.05 SEKELOA dalam pelatihan gamelan, qasidah, nasyid dan marawis serta pengadaan dan perawatan alat penunjang Tahun 2014', 'Bertujuan pemberdayaan masyarakat dalam kegiatan-kegiatan kebersamaan yang dikemas dalam wadah kesenian dan bernuansa islami, mempererat tali silaturahmi amtar warga RW.05 sekeloa khususnya dan memperkokoh rasa persatuan dan kesatuan antar warga RW.05 Sekeloa dengan warga sekitarnya', 'Jl. Sekeloa Utara No.198/152 C Rt.05/Rw.05 Kel. Sekeloa Kec. Coblong & Jl. Sekeloa Utara No.27 Rt.04/05 Kel. Sekeloa Kec. Coblong Bandung', 'e33fa1ab8e18e054d8b4b3a4000b39a0.pdf', 'a22d84ca719a3b07d32b06919163163c.pdf', NULL, 1, 17, '2014-03-30 17:00:00', NULL, 7),
(313, 7, NULL, 'KUBE PEMUDA KREATIF RAFI INDAH (KPKR) / EDI SUPRIYADI - KETUA', 'KUBE PEMUDA KREATIF RAFI INDAH (KPKR)', 'Program Kegiatan Dalam Rangka Pengembangan dan Sarana Prasarana KUBE PEMUDA KREATIF RAFI INDAH (KPKR) Tahun 2014', 'Tujuan penyediaan kesempatan lapangan kerja para penjahit di Bandung dengan lebih mantap, terarah produktif, peningkatan kepercayaan keyakinan dan minat kalangan masyarakat Bandung dan sekitarnya terhadap hasil produk secara meluas dan pencegahan kondisi pengangguran dan atau keterampilan para tenaga ahli jahit di Bandung dan sekitarnya', 'Jl. Cigondewah Rt.01 Rw.04 Kel.Cigondewah Rahayu Kec.Bandung Kulon / Jl. Cigondewah Kp.Lebaksari Rt.01 Rw.04 Kel.Cigondewah Rahayu Kec.Bandung Kulon Kota Bandung', '2423a3adefc7bc869c9b788210b64f97.pdf', '8c80ff64bfdcb0491966b9056525c4b5.pdf', NULL, 1, 15, '2014-03-30 17:00:00', NULL, 7),
(314, 7, NULL, 'PAUD AS SYAADAH / Dra. KOMALA SYAADAH - KETUA', 'PAUD AS SYAADAH', 'Program kegiatan PAUD AS SYAADAH dalam Pembangunan Gedung PAUD Tahap I Tahun 2014', 'Tujuan Dapat menyediakan wadah pendidikan yang dapat memberikan pelayanan rangsangan perkembangan, kecerdasan anak usia 3-6 tahun secara optimal, Membantu masyarakat yang kurang mampu khususnya anak-anak usia para sekolah yang tidak mendapat layanan program PAUD, baik jalur pendidikan formal maupun non formal, Memberikan kesempatan kepada masyarakat pra sejahtera untuk mengikuti pendidikan anak usia dini dengan biaya terjangkau, Meningkatkan dan menumbuhkan kembangkan pendidikan cara belajar sambil bermain khususnya untuk anak usia dini dan Terjaminnya mutu pendidikan dengan tenaga kependidikan dan fasilitas yang memadai sebagai upaya peningkatan pendidikan dengan terciptanya pembentukan sikap, penanaman nilai-nilai dasar dan kemampuan dasar sehingga terciptanya keberlangsungan dalam memasuki jenjang pendidikan selanjutnya', 'Gg. Bahagia No. 92d/41 Rt.07 Rw.01 Kel. Sukamaju Kec. Cibeunyting Kidul Kota Bandung / Jl. Jend. A Yani Gg. Bahagia Rt.07 Rw.01 Kel. Sukamaju Kec. Cibeunying Kidul Kota Bandung 40121', '0190fac74c36884df31119f11865fb37.pdf', 'ccc95714e46a5e17a6b2cb3a590df83b.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
