(318, 7, NULL, 'FORUM KOMUNIKASI GURU HONORER KOTA BANDUNG / YANYAN HERDIYAN', 'FORUM KOMUNIKASI GURU HONORER KOTA BANDUNG', 'kegiatan FORUM KOMUNIKASI GURU HONORER KOTA BANDUNG', 'kegiatan FORUM KOMUNIKASI GURU HONORER KOTA BANDUNG dalam pemberian bantuan terhadap guru yang berstatus honorer yang bertugas di sekolah di lingkungan wilayah administratif Kota Bandung mulai dari jenjang TK, RA, TKQ, SD, MI, SMP, MTs, SMA, SMK, MA dan SLB', 'Gg. Manunggal II C RT. 006 RW. 010 Kel. Cijerah Kec. Bandung Kulon / Ir. H. Juanda Blk. 340 A RT. 06 RW. 07 Kel. Dago Kec. Coblong Kota Bandung / Gd. Indonesia Menggugat Jl. Perintis Kemerdekaan No. 5 Bandung / 081931311007', '81c458c4c79cb07344e49124c5bc5b47.pdf', '4d029d4f9b84e2966e734b356edf8dea.pdf', NULL, 1, 13, '2014-03-30 17:00:00', NULL, 7),
(319, 7, NULL, 'LSM KELUARGA CENDEKIA BAHAGIA / KURNIA HAYATI, S.Si., Apt', 'LSM KELUARGA CENDEKIA BAHAGIA', 'kegiatan LSM KELUARGA CENDEKIA BAHAGIA dalam program Tahun 2014 “Keluarga Cerdas Generasi Berkualitas”.', 'memberikan motivasi kepada elemen keluarga agar optimal menjalankan perannya, meningkatkan keilmuan dan keterampilan sebagai bekal ayah, ibu, dan anak menghadapi era digital, membangun kesadaran bersama untuk menghadapi dampak negative perkembangan teknologi informasi secara optimal, meningkatkan kesadaran masyarakat tentang kesehatan lingkungan dengan metode bank sampah yang menguntungkan secara ekonomi untuk keluarga, membangun citra diri positif pada awak lewat permainan dan petualangan di alam.', 'Pojok Tanggulan Rt 09/Rw 03 Kel. Dago Kec. Coblong Bandung, Jl. Cikalapa II No. 3, Kel. Dago Kec. Coblong Bandung / 081572155992', '5b4145dd9aa0a8624eefcf835dd362aa.pdf', '48fbb6fe73e5794f403d5874001f61d9.pdf', NULL, 1, 3, '2014-03-30 17:00:00', NULL, 7),
(320, 7, NULL, 'PANITIA SOSIAL RUKUN WARGA 05 / DICKY CAHYANI', 'PANITIA SOSIAL RUKUN WARGA 05 / DICKY CAHYANI', 'kegiatan PANITIA SOSIAL RUKUN WARGA 05 dalam memotivasi dan memberikan sedikit kebahagiaan bagi anak yang tidak mampu dengan bermain sambil berwisata belajar untuk lebih mencintai alam', 'memberikan edukasi dan pengetahuan tentang alam, menimbulkan rasa percaya diri bagi anak yang tidak mampu dan mengajarkan anak untuk dapat berbuat baik, menghormati sesame, juga memberikan pengetahuan serta rasa kebanggaan akan budaya alam yang ada di Indonesia.', 'Jln. Karees Kulon No. 159/33 RT. 05 RW 05 Kel. Malabar Kec. Lengkong', '661bee48317fb8c579eb9f5741713784.pdf', 'ada04fa0aa599e522ffa26507c3e5e64.pdf', NULL, 1, 6, '2014-03-30 17:00:00', NULL, 7),
(321, 7, NULL, 'PANITIA REUNI SMP PASUNDAN 2 BANDUNG (BAKSOS) / DEDEN DEDI SUHENDI', 'PANITIA REUNI SMP PASUNDAN 2 BANDUNG (BAKSOS)  DEDEN DEDI SUHENDI', 'kegiatan PANITIA REUNI SMP PASUNDAN 2 BANDUNG (BAKSOS) dalam kegiatan reuni dan bakti sosial.', 'memupuk silaturahmi alumni yang diharapkan akan mewujudkan hal-hal positif bagi para alumni dan kepedulian sosial kepada sesama yang kurang mampu.', 'Jl. Kopo Gg. Sukaleueur RT. 009 RW. 006 Kel. Babakan Asih Kec. Bojongloa Kaler Bandung/ Jl. H. Samsudin No. 9 RT. 005 RW. 007 Kel. Ciateul Kec. Regol Bandung/ 087824949460', '607179462684008eb0c918ec5e5830a2.pdf', 'd499269facd902985dd3a94eab5f8bcd.pdf', NULL, 1, 13, '2014-03-30 17:00:00', NULL, 7),
(322, 7, NULL, 'PANITIA KERJA BHAKTI MASSAL / YANTI RAHMAWATI', 'PANITIA KERJA BHAKTI MASSAL / YANTI RAHMAWATI', 'pengadaan kerja bhakti massal di Gang Perikanan II RT. 06/05 Kel. Pelindung Hewan Kec. Astanaanyar Bandung', 'menjaring kalangan remaja hingga orang tua untuk ikut berperan aktif dalam mewujudkan masyarakat Kota Bandung yang sehat dan agar masyarakat dapat menyadari bahwa kita harus selalu menjaga lingkungan supaya kita bias hidup sehat.', 'Gg. Perikanan II RT. 06 RW. 05 Kel. Pelindung Hewan Kec. Astanaanyar Kota Bandung/ 085974225739', '7b6b2a1138eee654a0bc2ee1adabbdcf.pdf', 'c1838b4866d7c6845486cc8ff55afc76.pdf', NULL, 1, 7, '2014-03-30 17:00:00', NULL, 7),
(323, 7, NULL, 'PSAA AL-HILAL / Drs. H. DUDU ABDUL KARIM', 'PSAA AL-HILAL', 'kegiatan PSAA AL-HILAL dalam memenuhi kebutuhan pokok dan gizi anak melalui program subsidi yang memadai sehingga tumbuh kembang fisik anak berjalan dengan baik', 'untuk memberikan pelayanan baik dan permakanan dan atau pendidikannya yang berdasarkan pada profesi pekerjaan social terhadap anak yatim/piatu/terlantar dengan cara membantu kearah perkembangan pribadi yang wajar sesuai dengan ajaran islam serta berketerampilan hingga mereka menjadi muslim yang baik, penuh tanggung jawab baik terhadap dirinya, agama dan bangsa serta negaranya.', 'Jl. Peta Gg. Buah No. 173/95 RT 002 RW 004 Kelurahan Pelindung Hewan Kecamatan Astana Anyar / Jl. Peta Gg. Buah No. 156/95 (BLK No 5) RT 002 RW 004 Kelurahan Pelindung Hewan Kecamatan Astana Anyar / 08122425581 /022-5221472', '07930a6bede896f78c231a57f53cc49f.pdf', '7c25a84a3df28fcb7bcb43e0ed5611fe.pdf', NULL, 1, 7, '2014-03-30 17:00:00', NULL, 7),
(324, 7, NULL, 'PSAA AN-NIDA ROSADA / YOSEF ALAMSYAH', 'PSAA AN-NIDA ROSADA', 'kesejahteraan pelayanan terhadap para binaan PSAA AN-NIDA ROSADA', 'menjadi mitra baik dengan pemerintah dalam upaya mengatasi masalah sosial terutama pada penanggulangan dan pembinaan anak-anak yatim piatu yang kurang mampu sehingga mereka mendapatkan kehidupan yang layak dan pendidikan yang sudah barang tentu akan membawa kemaslahatan khusus untuk dirinya dan masyarakat pada umumnya, menciptakan dan menghasilkan para anak-anak binaan yang mandiri, disiplin, tanggung jawa, cerdas, kreatif serta berwawasan kedepan yang didasari oleh nilai keimanan dan ketakwaan yang luhur kepada ALLAH SWT.', 'Jl. Karapitan No.58/36A RT.02/05 Kelurahan Paledang Kecamatan Lengkong Kota Bandung/ Telp. 022 4218590', 'f18d168f9b215c2bb0324bab12c73cf3.pdf', NULL, NULL, 1, 13, '2014-03-30 17:00:00', NULL, 6),
(325, 7, NULL, 'PSAA AN-NIDA ROSADA / YOSEF ALAMSYAH', 'PSAA AN-NIDA ROSADA', 'kesejahteraan pelayanan terhadap para binaan PSAA AN-NIDA ROSADA', 'menjadi mitra baik dengan pemerintah dalam upaya mengatasi masalah sosial terutama pada penanggulangan dan pembinaan anak-anak yatim piatu yang kurang mampu sehingga mereka mendapatkan kehidupan yang layak dan pendidikan yang sudah barang tentu akan membawa kemaslahatan khusus untuk dirinya dan masyarakat pada umumnya, menciptakan dan menghasilkan para anak-anak binaan yang mandiri, disiplin, tanggung jawa, cerdas, kreatif serta berwawasan kedepan yang didasari oleh nilai keimanan dan ketakwaan yang luhur kepada ALLAH SWT.', 'Jl. Karapitan No.58/36A RT.02/05 Kelurahan Paledang Kecamatan Lengkong Kota Bandung/ Telp. 022 4218590', '425355687a45974f5201eff8690a6629.pdf', 'b6277261cb393b7d2b232ee46b538c41.pdf', NULL, 1, 13, '2014-03-30 17:00:00', NULL, 7),
(326, 7, NULL, 'PSAA FAJAR HARAPAN / Ir. H. SRIJANTO PRONO', 'PSAA FAJAR HARAPAN', 'kegiatan PSAA FAJAR HARAPAN dalam bantuan permakanan 2014-2015', 'terwujudnya pribadi anak-anak yang kokoh imannya, tekun ibadahnya, mulia ahlaknya, luas ilmunya, dan tinggi keterampilan serta cerah masa depannya dan terwujudnya pribadi anak asuh yang kuat komitmennya terhadap misi amar makruf nahi munkar.', 'perumnas sukaluyu blok e1 no.107 rt.04 rw. 09 kel.sukaluyu kec.cibeunying kaler kota bandung 40123/jl. Rereng barong no. 8 rt. 005 rw. 011 kel. Sukaluyu kec. Cibeunying kaler bandung 40123/022-2507505/081573390905', '13e0942340f5e80a1c638e822890b77d.pdf', '10c2adc4c99a6bdb82d5157b5301dadd.pdf', NULL, 1, 13, '2014-03-30 17:00:00', NULL, 7),
(327, 7, NULL, 'KELOMPOK PETERNAK BEBEK MITRA RAKYAT / AYI SAFA’AT', 'KELOMPOK PETERNAK BEBEK MITRA RAKYAT', 'kegiatan KELOMPOK PETERNAK BEBEK MITRA RAKYAT dalam pengadaan sarana dan prasarana ternak itik petelur', 'menjadikan usaha itik petelur menjadi usaha yang menguntungkan dan dapat memenuhi kebutuhan sehari-hari, membuat usaha itik petelur ini lebih meningkatkan kualitan dan kuantitasnya, ingin menjadikan usaha ini menjadi ternak yang lebih bermanfaat bagi masyarakat, untuk meningkatkan kesejahteraan kelompok peternak, memenuhi kebutuhan protein hewani masyarakat pada umumnya', 'Jl. Ranca Pacing RT 02 RW 04 Kelurahan Cisaranten Kidul Kecamatan Gedebage 40295 Kota Bandung / Jl. Ranca Pacing RT 02 RW 04 Kelurahan Cisaranten Kidul Kecamatan Gedebage 40295 Kota Bandung / 085320382584', '3ca518773b2e55d7b463b57033a5a5e4.pdf', 'd6338200781bafe7c6ab15b37d74dc90.pdf', NULL, 1, 19, '2014-03-30 17:00:00', NULL, 7),
(328, 7, NULL, 'KELOMPOK USAHA TERNAK JANGKRIK ASTIN MULIA / ASEP SOLEH', 'KELOMPOK USAHA TERNAK JANGKRIK ASTIN MULIA', 'pengembangan usaha kelompok usaha ternak jangkrik pada KELOMPOK USAHA TERNAK JANGKRIK ASTIN MULIA.', 'memajukan usaha kelompok usaha ternak jangkrik di bidang usaha ekonomi produktif ternak, meningkatkan kesejahteraan anggota dan meningkatkan semangat perjuangan bagi pengurus anggota.', 'Jl. Situ Gunting Timur RT. 02 RW. 08 Kel. Sukaasih Kec. Bojongloa Kaler / Jl. Situ Gunting Timur No. 47 RT. 02 RW. 08 Kel. Sukaasih Kec. Bojongloa Kaler / 085324208776', '6c670f82673cd72cf6f503ae3eca9099.pdf', '8d16ab42f8f9c20d23ea14ee0c72affa.pdf', NULL, 1, 19, '2014-03-30 17:00:00', NULL, 7),
(329, 7, NULL, 'KELOMPOK TERNAK DOMBA PRIANGAN / DIKDIK NUR HAKIM', 'KELOMPOK TERNAK DOMBA PRIANGAN', 'kegiatan KELOMPOK TERNAK DOMBA PRIANGAN dalam pengembangan usaha budidaya domba', 'meningkatkan populasi, produktivitas, dan mutu bibit domba, meningkatkan skala usaha domba menjadi skala usaha ekonomis, meningkatkan pendapatan dan kesejahteraan peternak, mengembangkan usaha kelembagaan kelompok domba, menciptakan kawasan sumber bibit domba di Kota Bandung, dan pelestarian plasma nuftah domba lokal.', 'Jl. Cikuda RT. 04 RW. 11 No. 117 Kel. Pasir Biru Kec. Cibiru Kota Bandung / Jl. Cikuda RT. 04 RW. 11 No. 117 Kel. Pasir Biru Kec. Cibiru Kota Bandung / 081214470769', '98596a16e430ed946533291b8c246749.pdf', '1da626c5fb092b81888789acbda323bc.pdf', NULL, 1, 19, '2014-03-30 17:00:00', NULL, 7),
(330, 7, NULL, 'MASYARAKAT SINGKONG INDONESIA (MSI) / DRS. U. JAMALUDIN', 'MASYARAKAT SINGKONG INDONESIA (MSI)', 'kegiatan MASYARAKAT SINGKONG INDONESIA (MSI) dalam kegiatan MSI untuk pengadaan sarana produksi tanaman dan tenaga kerja', 'mengembangkan argribisnis singkong bagikesejahteraan bersama para pemangku kepentingan terkait dan mengembangkan dan memperluas pemasaran singkong dan produk-produk dari singkong', 'Mandalawangi RT. 002/007 Kel. Pasanggrahan Kec. Ujungberung Kota Bandung/ Mandalawangi RT. 002/007 Kel. Pasanggrahan Kec. Ujungberung Kota Bandung/085721126834', 'a1ffcae6fa624e461ce46daca2a05000.pdf', '45c10509ea237e843c31586baf63dc67.pdf', NULL, 1, 19, '2014-03-30 17:00:00', NULL, 7),
