(339, 7, NULL, 'FORUM PONDOK PESANTREN KOTA BANDUNG / Drs. HR. EDI KOMARUDIN M.Ag.', 'FORUM PONDOK PESANTREN KOTA BANDUNG', 'kegiatan FORUM PONDOK PESANTREN KOTA BANDUNG dalam bantuan biaya operasional forum pondok pesantren kota Bandung', 'Forum Pondok Pesantren (FPP) Kota Bandung mampu mendukung visi dan misi Bandung Kota Agamis guna mencapai masyarakat madani yang diridhai Allah SWT melalui usaha dalam memberdayakan Pondok Pesantren dalam membangun kesalehan individual dan kesalehan sosial bagi peningkatan kesejahteraan masyarakat di Kota Bandung dan agar Pondok Pesantren di Kota Bandung mampu meningkatkan terwujudnya “ukhuwah islamiyah” dengan penuh kesejukan dan kedamaian guna memantapkan Persatuan dan Kesatuan Bangsa dalam kehidupan masyarakat di Kota Bandung.', 'Jl. Sumbersari RT/RW 005/008 Kel. Cisaranten Kulon Kec. Arcamanik Kota Bandung / Jl. Pesantren Cigadung No. 31 RT/RW. 03/06 Kel. Cigadung Kec. Cibeunying Kaler Kota Bandung/ 081321052286', '11a3fc6b4c9ff9cb599bb7113cc21c6c.pdf', 'beca4f67e9bec82d340c940600050031.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(340, 7, NULL, ' DKM AL-HIDAYAH / ATE SUDRAJAT, SE. Mag', 'DKM AL-HIDAYAH', 'kegiatan DKM AL-HIDAYAH', 'menjadi salah satu wadah untuk mewujudkan ikhuwah Islamiyah dan wahdatul ummah dengan meningkatkan kerjasama berlandaskan kejujuran watak untuk berbakti kepada agama, nusa dan bangsa Indonesia. Adapun tujuan dari masjid Al-Hidayah adalah Pembinaan jamaah untuk menerapkan dan mengembangkan pribadi akhlakul karimah berakar Al-Quran', 'Komplek Mega Asri III-E1/3 RT. 07 RW. 07 Kel. Sukaraja Kec. Cicendo Kota Bandung / Komplek Bio Farma No. 12 Jl. Babakan Cianjur RT. 06 RW. 007 Kel. Cempaka Kec. Andir Kota Bandung / 022-6028881 / 081321800249', '760738619de5198c9871ab0cc669801c.pdf', 'f0dcdfe28da38fdbe2cce521bde2005b.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(341, 7, NULL, 'PANITIA WISATA ROHANI MAJELIS TAKLIM MASJID SITI ASIYAH', 'PANITIA WISATA ROHANI MAJELIS TAKLIM MASJID SITI ASIYAH', 'kegiatan PANITIA WISATA ROHANI MAJELIS TAKLIM MASJID SITI AISYAH dalam wisata rohani majelis Ta’lim Masjid Siti Aisah', 'mempererat jalinan tali silaturahmi antara jamaah, dilingkungan lembaga dan warga masyarakat bandung, khususnya kelurahan babakan asih kecamatan bojongloa kaler, tadabur alam tafakur pada ciptaan Allah SWT sebagai pendidikan insan yang berkualitas menuju rido Allah SWT dan mewujudkan aspirasi masyarakat yang beragama islam agar menjadi warga Negara yang baik beriman beramal bertaqwa kepada Allah SWT, dan senantiasa cinta taat kepada pemerintah Negara kesatuan republic Indonesia', 'Jl. Kopo Gg. Sukaleueur RT. 02 RW. 06 Kel. Babakan Asih Kec. Bojongloa Kaler 40232 Kota Bandung / Jl. Kopo Gg. Sukaleueur RT. 04 RW. 06 Kel. Babakan Asih Kec. Bojongloa Kaler 40232 Kota Bandung / 022-6002023 / 082116446238', '82c64b31e00a641e456739b67aecef96.pdf', 'a18e7eb06cade700af26480779c7df74.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(342, 7, NULL, 'MADRASAH MDTA AL-WAHAB / HETI SUMIRAT', 'MADRASAH MDTA AL-WAHAB', 'subsidi operasional penyelenggaraan di Madrasah Diniyah Takmiliyah Awaliyah (MDTA) Al-Wahab', 'memberikan bekal kemampuan dasar kepada warga belajar untuk mengembangkan kehidupannya sebagai : warga muslim yang beriman, bertaqwa, dan beramal saleh serta berakhlak mulia, sebagai warga Negara Indonesia yang berkrepribadian, percaya pada diri sendiri, serta sehat jasmani dan rohani, membina warga belajar agar memiliki pengalaman, pengetahuan keterampilan beribadah dan sikap terpuji yang berguna bagi pengembangan pribadinya, mempersiapkan warga belajar untuk dapat mengikuti pendidikan agama islam pada Diniyah Takmiliyah', 'Jl. Saturnus Utara IV No. 10 RT. 01 RW. 10 Kel. Manjahlega Kec. Rancasari Kota Bandung 40295 / Jl. Saturnus Utara Blok O RT. 04 RW. 10 Kel. Manjahlega Kec. Rancasari Kota Bandung 40295 / 022-76496195', '9d30027b5a466fc29db468e412f28194.pdf', 'f378db76710a1b6a079a276512d6fe78.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
