(371, 7, NULL, 'DKM MASJID AT-THOHIRI / HANDI SETIAWAN', 'DKM MASJID AT-THOHIRI', 'kegiatan DKM MASJID AT THOHIRI dalam pembangunan mesjid', 'untuk membangun sarana tempat ibadah yang memadai, agar umat islam yang mau beribadah terutama di hari jumat bisa tertampung semua didalam masjid, selain untuk tempat ibadah juga digunakan untuk sarana mendidik anak-anak untuk mengenal didalam ajaran agama islam dan menurut pengamatan kami anak-anak yang tinggal didaerah kami masih sangat kurang mendapat pendidikan agamanya, lokasi masjid At-Thohiri berada di tengah permukiman non muslim;` di depan, belakang, kanan, dan kiri masjid semuanya non muslim, di sepanjang gang umar hanya masjid At-Thohiri yang masih ada symbol ISLAM nya, kami berjuang sekuat tenaga untuk menjaga dan mempertahankannya.', 'Gang Rais III No. 151/6A RT.03 RW. 09 Kelurahan PasirKaliki Kecamatan Cicendo. Jl. Kebon Kawung GG. Umar No. 8 RT. 03 RW. 09 Kelurahan PasirKaliki Kelurahan Cicendo Bandung 40171 / 0821 1608 7236', 'fca68b98c8b82b71239e2e83165851b9.pdf', '2093be49523c352d88e0fd661cf6fde9.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
