(401, 7, NULL, 'PANITIA PEMBANGUNAN MESJID ASY SYUKUR / USAN SUPRIATNA SP', 'PANITIA PEMBANGUNAN MESJID ASY SYUKUR', 'kegiatan PANITIA PEMBANGUNAN MESJID ASY SYUKUR dalam pembangun mesjid', 'menyediakan sarana untuk melakukan ibadah keagamaan terutama shalat berjamaah dan kegiatan keislaman lainnya seperti pengajian, pendidikan non formal untuk anak-anak, sarana untuk mempererat tali silaturahmi antar warga, dan menyediakan sarana yang memadai sehingga kekhusukan shalat yang diadakan di mesjid bisa terjaga.', 'Jl. Babakan Cianjur RT 10 RW 02 Kel. Sukaraja Kec. Cicendo Kota Bandung 40175/Jl. Babakan Radio RT 04 RW 02 Kel. Sukaraja Kec. Cicendo Kota Bandung/087822460053', '4e0302e30eef4bd946a3415eed053585.pdf', 'ee4886409c328b64dc9a2f753a5b57c8.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
