(411, 7, NULL, 'Madrasah Hikmatul Auliya - Ketua - Eko Haryanto', 'MADRASAH HIKMATUL AULIYA  TAHUN 2015', 'Program Kegiatan Madrasah Hikmatul Auliya Tahun 2015', 'Untuk menanamkan Aqiqah, Manhaj dan Akhlak Ahlusunnah Wal Jama’ah, mendidik dan melatih Generasi penerus multi skill yang mandiri, Da’wah melalui karya nyata di bidang Pendidikan dan Skill terapan, mengajak dan menanamkan terhadap setiap Orang untuk peduli terhadap Anak yatim dan Dhuafa dan mengajak kepada seluruh Kaum Muslimin untuk menjadi Pejuang-pejuang Alloh, mensyiarkan Agama Islam sebagai Rohmat bagi seluruh alam', 'Jl. Sukaraja No. 7 RT. 02 RW. 06 Kel. Sukaraja Kec. Cicendo Bandung / Jl. Sukaraja II No. 07 RT. 02 RW. 06 Bandung-Cimahi / 082216667578', '8d9cb843dce094ac34048d67685a1523.pdf', '5d13a67d05db572ba011fd9d56ff1c6e.pdf', NULL, 1, 9, '2014-03-17 17:00:00', NULL, 7),
(412, 7, NULL, 'DKM At Taubah - Ketua - H. Amas Ruchanda', 'DKM AT TAUBAH TAHUN 2015', 'Program Kegiatan DKM At Taubah Tahun 2015', 'Untuk  menjadikan mesjid sebagai pusat kegiatan masyarakat, menjadikan mesjid sebagai tempat melakukan ibadah terutama sholat berjamaah secara rutin agar sholat kita terjaga dan meningkat, menjadikan mesjid sebagai tempat pencerahan  dan pendidikan agama Islam secara nonformal, menjadikan mesjid sebagai sarana efektif untuk mempererat tali silaturahmi khususnya antar warga muslim dan warga lainnya dan meningkatkan kesadaran masyarakat dan tanggung jawab umat Islam terhadap kepentingan kemajuan syi’ar agama, sebagai wujud keimanan dan ketaqwaan kepada Allah SWT', 'Cisurupan RT. 005 RW. 003 Kel. Cisurupan Kec. Cibiru Kota Bandung, Komplek Cisurupan RT. 006 RW. 003 Kel. Cisurupan Kec. Cibiru Kota Bandung / 08986480281', 'e779beec61d7e8606e94b64ede699a89.pdf', 'c44672baef653795337dce0c8757a41b.pdf', NULL, 1, 9, '2014-03-17 17:00:00', NULL, 7),
