(425, 7, NULL, 'Renovasi Bangunan Dan Pengadaan Prasarana Sarana Madrasah Diniyah Takmiliyah Al-‘Ashri - Ketua - Ina Karningsih, A.Ma.Pd', 'RENOVASI BANGUNAN DAN PENGADAAN PRASARANA SARANA MADRASAH DINIYAH TAKMILIYAH AL-‘ASHRI  TAHUN 2015', 'Program Kegiatan Renovasi Bangunan Dan Pengadaan Prasarana Sarana Madrasah Diniyah Takmiliyah Al-‘Ashri Tahun 2015', 'Untuk  mempublikasikan keberadaan MADRASAH DINIYAH/DINIYAH TAKMILIYAH AWALIYAH (DTA) kepada masyarakat umum, memberikan rangsangan terhadap mptivasi para didik dalam mengikuti program Pendidikan Agama Islam di DTA, meningkatkan semangat para pendidik (para ustadz-ustadzah) dalam memberikan pembinaan dan meningkatkan kwalitas pelaksanaan pembelajaran di MADRASAH DINIYAH/DINIYAH TAKMILIYAH AWALIYAH, meningkatkan kerjasama dan persaudaraan antar pendidik di madrasah, yang akhirnya diharapkan dapat berinteraksi dan terjalin komunikasi yang baik dan membuktikan kepada para pejabat pemerintah (khususnya tingkat kelurahan dan kecamatan) dan para pemerhati pendidikan atas keberadaan MADRASAH DINIYAH/DINIYAH TAKMILIYAH AWALIYAH (DTA).', 'Harumansari RT. 02 RW. 07 Kel. Cigending Kec. Ujungberung Kota Bandung 40611 / Harumansari RT. 04 RW. 07 Kel. Cigending Kec. Ujungberung Kota Bandung 40611 / 081536696683', '5648252dd365844419a835c5e08d141c.pdf', '80b38d2eff52e38e01a7e4387d586b74.pdf', NULL, 1, 9, '2014-03-17 17:00:00', NULL, 7),
