(459, 7, NULL, 'WARGA RW 06 / RUDIAT RAHMAT', 'WARGA RW 06', 'kegiatan WARGA RW 06 pembangunan/renovasi gedung serba guna RW 06 Tahap I', 'meningkatkan pelayanan terhadap masyarakat, membangun komunikasi yang sinergi antara pengurus RW.06 dengan warganya dan memfasilitasi berbagai kegiatan masyarakat yang bersifat membangun demi kemajuan RW.06 Kelurahan Sukamaju Kecamatan Cibeunying Kidul.', 'Jl. SADIREJA NO. 344/41 RT.03 RW.06 KEL. SUKAMAJU KEC. CIBEUNYING KIDUL KOTA BANDUNG / Jl. SADIREJA NO.337/41 RT.02 RW.06 KEL. SUKAMAJU KEC. CIBEUNYING KIDUL KOTA BANDUNG', '7395b9d31093187d58ca7dc4800cecac.pdf', '3bce85e2251370312f8583f8d99cc011.pdf', NULL, 1, 1, '2014-03-30 17:00:00', NULL, 7),
