(461, 7, NULL, 'DKM MASJID JAMIE NUR-HIDAYAH / ACHMAD SOBANDI', 'DKM MASJID JAMIE NUR-HIDAYAH', 'kegiatan PENGURUS DKM PENANGGUNG JAWAB PEMBANGUNAN MASJID JAMI’E NUR-HIDAYAH dalam memperbaiki sarana dan prasarana Masjid', 'terwujudnya kebersamaan dalam segala kegiatan bermasyarakat terkebih dalam menciptakan modal dan mental dalam beragama serta dapat terciptanya manusia dan warga yang berakhlak mulia dan fanatisme dalam menjalankan syareatnya dan meningkatkan semangat taqarrub illalaah dan meningkatkan kwalitas ibadah dengan timbulnya kekhususan ibadah didalam masjid.', 'Jl. Budiman No. 25 Rt. 03/Rw.02 Kel. Ciroyom Kec. Andir Kota Bandung', '87effb1b20260e5a93df5ce3973a6745.pdf', '61d9e77c7ede447e0131c4f3a0158bf3.pdf', NULL, 1, 1, '2014-03-30 17:00:00', NULL, 7),
