(475, 7, NULL, 'PANITIA PEMBANGUNAN MESJID AT-TAQWA / UST. BAHRUM ALI BASAH, S.Ag', 'PANITIA PEMBANGUNAN MESJID AT-TAQWA', 'kegiatan PANITIA PEMBANGUNAN MESJID AT-TAQWA dalam pembangunan Masjid At-Taqwa di Babakan Cilandak', 'Menumbuhkan kesalehan sosial dan individual, Sarana silaturahmi antar masyarakat Babakan Cilandak, Menjadikan Mesjid bersih representative sehingga warga merasa nyaman betah beribadah, Warga merasa bangga mesjidnya keadaan kokoh kuat dan sehat, dan Kepercayaan masyarakat meningkat sebab mesjidnya dibangun tanpa membebani masyarakat, walaupun bantuan masyarakat boleh-boleh saja secara sukarela.', 'Jl. Cigadung Pesantren No.30 RT 02/06 Kel. Cigadung Kec. Cibeunying Kaler & Jl. Babakan Cilandak RT 02/04 No. 271 Kel. Sukarasa Kec. Sukasari Kota Bandung', 'e46c30f8561c65ecb1e11d4a88f76938.pdf', '352ec371353f4d8697389e9482cfbf16.pdf', NULL, 1, 1, '2014-03-30 17:00:00', NULL, 7),
(476, 7, NULL, 'PANITIA RENBANG MASJID BAITURRAHMAH / PANTJAWIDI DJUHARNOKO, SKmM.Kes', 'PANITIA RENBANG MASJID BAITURRAHMAH', 'kegiatan PANITIA RENOVASI DAN PENGEMBANGAN MASJID BAITURRAHMAH dalam renovasi dan pengembangan masjid', 'sebagai tempat untuk melakukan ibadah terutama sholat berjamaah secara rutin agar kualitas sholat dapat terjaga dan meningkat, sarana untuk pencerahan dan pendidikan Agama Islam secara nonformal, dan secara efektif untuk mempererat tali silaturahmi khusunya antar warga muslim dan warga lainnya', 'Jl. Saluyu B XIV No. 386 RT. 07 RW. 07 Kel. Cipamokolan Kec. Rancasari Kota Bandung / Jl. Saluyu Raya No. 2 RW. 07 Kel. Cipamokolan Kec. Rancasari Kota Bandung/Jl. Saluyu A XIII No. 191 RT. 002 RW. 007 Kel. Cipamokolan Kec. Rancasari Bandung / 087822822162 / 081320484821 / 081320749912', '15b86eb5e90cbd9d0eb4cdf7e2cdcdcd.pdf', '5be1cf77c92c6d5ebc0388f20ab13093.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
(477, 7, NULL, 'MASJID AL-AMIN / IWAN KUSTIAWAN', 'MASJID AL-AMIN', 'Renovasi Masjid Al-Amin', 'memberikan tempat ibadah supaya Warga Masyarakat sekitar dapat menjalankan Ibadah/Sembahyang dengan enak, nyaman dan apabila musim hujan tiba tidak terganggu oleh atap yang bocor.', 'Jl. Sukarasa No. 182/143E RT. 04 RW. 12 Kel. Cicadas Kec. Cibeunying Kidul, Kota Bandung 40121 / Jl. Sukarasa RT. 01 RW. 12 Kel. Cicadas Kec. Cibeunying Kidul, Kota Bandung 40121 / 085351297871', '91aa79db0c2281db29cc97c4b7c38159.pdf', '308936d27b57f339ecac5c67fafe52f0.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
(478, 7, NULL, 'PANITIA PEMBANGUNAN RENOVASI MASJID MIFTAHUSSALAM / SAEPUDIN', 'PANITIA PEMBANGUNAN RENOVASI MASJID MIFTAHUSSALAM', 'renovasi pembangunan Masjid Miftahussalam', 'tempat peribadatan yang mempunyai daya tamping luas, ideal, nyaman serta dapat dimanfaatkan masyarakat umum, meningkatkan kehusyuan dalam beribadah serta meningkatkan gairah belajar dalam menggali ilmu agama, sebagai tempat syiar Islam dan pengkajian Ilmu Agama yang terprogram, menanamkan rasa bangga terhadap umat Islam khususnya yang ada dilingkungan Antapani mempunyai tempat Ibadan yang luas, megah, dan indah, upaya mengubah paradigma berfikir masyarakat tentang pentingnya sebuah tempat milik Allah SWT yang harus dibangun, dipelihara, dimakmurkan, karena mesjid sangatlah berbeda dengan bangunan lainnya yang ada dimuka bumi ini baik secara nilai, sejarah, kegunaan. maupun aktifitas didalamnya, menjadi tempat yang sangat istimewa dalam upaya mengobati rasa rindu kepada Illahi Robbi dan Rosul-Nya baik secara berjamaah maupun individu, membangun pola hidup sosial, gotong royong, swadaya yang dirasakan saat ini semakin menurun, dan ikut berpartisipasi dalam tujuan pembangunan nasional dalam upaya membentuk manusia Indonesia seluruhnya.', 'Jl. Antapani Gg. Sukapura RT. 004 RW. 006 Kel. Antapani Kulon Kec. Antapani Bandung/ Jl. Antapani Gg. Sukapura II RT. 004 RW. 006 Kel. Antapani Kulon Kec. Antapani', '119e9e2d2aef0d70fa7c1e40307536d2.pdf', '583eb1d98e52a56c82afa4cc08b6399e.pdf', NULL, 1, 9, '2014-03-30 17:00:00', NULL, 7),
(479, 7, NULL, 'MESJID NURUL ISLAM / AGUS KURNIA', 'MESJID NURUL ISLAM', 'Pembangunan/peningkatan MESJID NURUL ISLAM RW.10 Cigending Ujungberung Bandung', 'menumbuh kembangkan penghayatan dan pengamalan ajaran agama islam, melalui masjid diharapkan tercapai tujuan akhir manusia seutuhnya yaitu sejahtera di dunia dan akhirat serta dijauhkan dari siksa api neraka, mencetak pribadi manusia sejati, dan menyebarluaskan target syiar agama islam di kalangan muslimin.', ' Jl. Cigending RT. 03/10 Kel. Pasirwangi Kec. Ujungberung / Jl. Cigending RT. 03/10 Kel. Pasirwangi Kec. Ujungberung', '3f105c0b5d7b3f89e61a82b60e9a17f4.pdf', '6309f8f3154e3bb812262d3a08a8b475.pdf', NULL, 1, 1, '2014-03-30 17:00:00', NULL, 7),
