(584, 7, NULL, 'LKSA PUTRI WILLIAM BOOTH BANDUNG / NICOLAS LENGKONG', 'LKSA PUTRI WILLIAM BOOTH BANDUNG', 'kegiatan LKSA PUTRI WILLIAM BOOTH BANDUNG dalam kegiatan LKSA PUTRI WILLIAM BOOTH BANDUNG memberikan pelayanan lahir dan batin yang didasarkan pada ajaran Kristiani dan rasa kasih yang tidak pernah mereka peroleh dari keluarga maupun masyarakat sekitar, sehingga menjadikan mereka anak-anak yang bertanggungjawab terhadap diri sendiri, masyarakat dan Tuhan serta mencegah semakin banyaknya anak – anak usia sekolah yang putus sekolah dan terlantar , dikarenakan kondisi ekonomi keluarga.', 'kegiatan LKSA PUTRI WILLIAM BOOTH BANDUNG dalam kegiatan LKSA PUTRI WILLIAM BOOTH BANDUNG memberikan pelayanan lahir dan batin yang didasarkan pada ajaran Kristiani dan rasa kasih yang tidak pernah mereka peroleh dari keluarga maupun masyarakat sekitar, sehingga menjadikan mereka anak-anak yang bertanggungjawab terhadap diri sendiri, masyarakat dan Tuhan serta mencegah semakin banyaknya anak – anak usia sekolah yang putus sekolah dan terlantar , dikarenakan kondisi ekonomi keluarga.', 'JL. Jawa No.18 Bandung RT/RW 005/006', '96351b44c4295c54f5d417a11accbb26.pdf', '9a103a112bbb33d6b63bf1708e80541f.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
