(586, 7, NULL, 'PANITIA SOSIALISASI BAHAYA AIDS DAN SEX BEBAS / PIPIT HARTIATI ALISANTI', 'PANITIA SOSIALISASI BAHAYA AIDS DAN SEX BEBAS', 'Sosilalisasi Bahaya Aids & Sex Bebas di kelurahan Pelindung Hewan kecamatan Astanaanyar Kota Bandung Tahun Anggaran 2014', 'mengabdikan diri di tenagh-tengah kehidupan masyarakat luas dengan berbagai kompleksitas permasalahannya, sehingga diharapkan setahap demi setahap dapat memberikan motivasi kepada masyarakat untuk menjadi masyarakat yang sejahtera baik dibidang material maupun mental spiritual serta lahir dan bathin.', 'Gg. Perikanan II RT.006/005 Kel Pelindung Hewan Kec Astanaanyar Bandung', '818832feb02f8ab34683ddfeae69ea78.pdf', '69516883239a76ac3c8186d8d4c119e3.pdf', NULL, 1, 12, '2014-03-30 17:00:00', NULL, 7),
(587, 7, NULL, 'FORUM PEMUDA PEDULI / BUDI SOBARNA', 'FORUM PEMUDA PEDULI', 'Penyuluhan Bahaya Narkoba di Kalangan Ibu Rumah Tangga dalam Memperingati Hari Narkoba Sedunia.', 'Bahan Masukan bagi Perumusan Kebijakan Penanganan Masalah Penyalahgunaan Narkoba Khususnta Keikutssertaan Pencegahan dan Penanganan Penyalahgunaan masalah Narkoba, Serta memberikan Pemahaman kepada Ibu-Ibu Rumah Tangga Tentang Bahaya Narkoba sehingga kedepannya bisa mengawasi perilaku dan pergaulan anak di lingkungannya.', 'JL. Inhoftank Gg. Perikanan Buntu No. 15 RT.001/005 Kel. Pelindung Hewan Kec. Astana Anyar / Gg. Perikanan Buntu No. 15 Kel. Pelindung Hewan Kec. Astana Anyar', 'eda028a7cc792758e508614bdefceeec.pdf', 'e41530c6eb82b01866e572421985cabe.pdf', NULL, 1, 7, '2014-03-30 17:00:00', NULL, 7),
