(682, 2, NULL, 'GENERASI ANTI NARKOBA & KRIMINALITAS (G.A.N.K.) - KETUA - AA SUMIRAT', 'GENERASI ANTI NARKOBA & KRIMINALITAS (G.A.N.K.) TAHUN 2017 (TAHUN 2016 SUDAH DAPAT)', 'Metode pencegahan dan pemberantasan narkoba yang paling mendasar dan efektif adalah promotif dam preventif. Upaya yang paling praktis dan nyata adalah represif. Upaya manusiawi adalah kuratif dan rehabilitatif.\n\n(Permohonan Tertulis, Proposal, Surat Keterangan Tanggung Jawab, Surat Pernyataan Kesediaan Menyediakan Dana Pendamping, Akta Notaris Pendirian, Surat Pernyataan Tanggung Jawab, NPWP, Surat Keterangan Domisili, Izin Operasional Tanda Daftar, Bukti Kontrak Sewa Gedung/Bangunan, Fotocopy KTP Ketua dan Sekretaris, Fotocopy Nomor Rekening Bank.)\n', 'Agar Terjalinnya kerjasama yang baik di antara kita demi terlaksananya program agar manfaatnya dapat segera dirasakan oleh anak anak binaan RPA Yayasan GANK', 'Jl. Sadang No.26 Cirengot RT.03/02 Kel. Sukamulya Kec. Cinambo Bandung; \nTelp: 081222245046; ', '3206c3969a854e4b8d7b5e405f0544bc.pdf', NULL, NULL, 1, 4, '2016-03-01 17:00:00', NULL, 6),
(683, 2, NULL, 'YAYASAN ALBURHAN NURUL IKHLAS; Ketua: H. DODDY INDRA, S.Sos', 'YAYASAN ALBURHAN NURUL IKHLAS Tahun 2017', 'Mesjid merupakan sarana peribadatan umat Islam yang berfungsi meningkatkan kwalitas iman,islam dan ikhsan juga sebagai tempat anak-anak GPKM (Generasi Penerus Kaum Muslimin) yang belajar ngaji dan ibadah lainnya sebagai tindak lanjut upaya peningkatan pembangunan manusia seutuhnya.', 'Memberdayakan potensi yang dimiliki oleh masyarakat untuk menjadikan masyarakat yang madani dan terwujudnya pendidikan berdasarkan pada Al-Quran dan As-Sunah serta peraturan perundangan yang berlaku.', 'Jl. Sirnagalih No.20 RT.05/04 Kel. Pasirlayung Kec. Cibeunying Kidul Kota Bandung; \nTelp: 081321869519; ', '2664849cd05e47ed80b7cdf9671ae33a.pdf', NULL, NULL, NULL, NULL, '2016-03-13 17:00:00', NULL, NULL),
(684, 2, NULL, 'YAYASAN DARUTTAUBAH ASSALAFIAH ; Ketua: KH. AHMAD HAEDAR', 'YAYASAN DARUTTAUBAH ASSALAFIAH TAHUN 2017', 'Permohonan Pembangunan Gedung Baru Madrasah Tahun 2017;\nDesakan kebutuhan adanya sarana dan prasarana pendidikan yang memadai untuk kegiatan belajar mengajar santiwan dan santriwati.', 'Sebagai upaya pengembangan dan kaderisasi sumber daya manusia yang beraqidah benar,berahlak mulia dan memiliki pemahaman yang lurus menuju tertib beragama dibawah naungan dan rahmat alloh subhanahu wata''ala.', 'Jl. Hidayat No. 2 RT.10 RW.07 Kel. Kebon Jeruk Kec. Andir Kota Bandung; \nTelp: 081221005999;', '7cd295025d2ff7b7d100ca0897410d8f.pdf', NULL, NULL, NULL, NULL, '2016-03-15 17:00:00', NULL, NULL),
(685, 2, NULL, 'YAYASAN ANAK SHALEH; Ketua: H. HAIRIL FUAD, Lc', 'YAYASAN ANAK SHALEH TAHUN 2017', 'Permohonan Bantuan Dana Pembangunan Sekolah Tahfidz Al-Qur''an Tahun 2017;\nPembangunan sekolah Tahfidz Al-Qur''an 2 Lantai konstruksi yang sedang dilaksanakan yayasan anak shaleh.', 'Permohonan Bantuan Dana Hibah untuk pendanaan pembangunan Sekolah Tahfiz.', 'Jl. Rancabolang No.1 RT.06/10 Margasari-Buahbatu Bandung;\nTelp: 022-7501473 / 022-70770529;', '4a29f1d462d5bf8e71edfc6798951ac9.pdf', NULL, NULL, NULL, NULL, '2016-03-16 17:00:00', NULL, NULL),
(686, 2, NULL, 'DEWAN KOPERASI INDONESIA (DEKOPIN) KOTA BANDUNG; Ketua: H. USEP SUMARNO, SH., SE., MM., M.Si', 'DEWAN KOPERASI INDONESIA (DEKOPIN) KOTA BANDUNG TAHUN 2017', 'Permohonan Bantuan Dana Operasional dan Pembinaan Dekopinda Kota Bandung Tahun 2017;\nSebagai lembaga tertinggi Gerakan Koperasi Indonesia yang bersifat idiil dan otonom serta berfungsi sebagai wadah memperjuangkan kepentingan dan pembawa aspirasi Gerakan Koperasi. ', 'Newujudkan sarana dan prasarana Dekopinda Kota Bandung yang lebih memadai sehinggaDekopinda Kota Bandung dapat lebih meningkatkan fungsi dan perannya dalam melaksanakan pembinaan perkoperasian baik bagi gerakan koperasi maupun masyarakat.', 'Jl. Buahbatu No. 26 Bandung; \nTelp: 022-7300321', '03d155ed2afd1f8cd4b46fcb8778a774.pdf', NULL, NULL, 1, NULL, '2016-03-21 17:00:00', NULL, 2),
(687, 2, NULL, 'YAYASAN AL-HIKMAH MANGLAYANG PALASARI;  Ketua: Drs. H. ARDI KOSASIH', 'YAYASAN AL-HIKMAH MANGLAYANG PALASARI TAHUN 2017', 'Permohonan Bantuan Hibah TA 2017 untuk Pembangunan Gedung Madrasah;\nMasjid adalah tempat pertama kali dibangun oleh rasulullah pada waktu hijrah ke madinah,masjid merupakan sarana pembinaan umat dalam arti luas,bukan hanya sebagai tempat penyelenggaraan sholat berjamaah.', 'Terciptanya umat islam Indonesia yang beriman dan bertakwa sejahtera lahir dan bathin.', 'Jl. Manglayang VIII No.4 Komplek Cilengkrang II RT.04 RW.06 Kel. Palasari Kec. Cibiru Ujung Berung Bandung; \nTelp: 081394597686, 087723507178;', 'b33d2fbecf9b3c9be97c6729decff56f.pdf', NULL, NULL, NULL, NULL, '2016-03-21 17:00:00', NULL, NULL),
(688, 2, NULL, 'YAYASAN AR-RIFQI; Ketua: Hj. LILIS LISNAWATI, M.Ag', 'YAYASAN AR-RIFQI TAHUN 2017', 'Permohonan Bantuan Hibah untuk memenuhi kebutuhan anak yatim dan pembangunan asrama Tahun 2017;\nSemangat yang melandasi adalah firman Allah dalam Al-Qur''an Surat Almaun Yang Artinya:"Tahukah kamu siapakah orang yang mendustakan agama?Yaitu orang yang menghardik anak-anak yatim dan tidak memberi makan orang -orang miskin"', 'Tersedianya sarana dan prasarana pendidikan agama dan keterampilan kerja serta usaha bagi anak-anak yatim piatu dan dhuafa.', 'Komplek Bumi Panyileukan K8 No. 29 Rt.03 Rw. 10 Cipadung Kidul; \nTelp: 022-7807628;', '1d8d7c41f70c694210d097e2159a1e1e.pdf', NULL, NULL, 1, 13, '2016-03-23 17:00:00', NULL, 6),
(689, 2, NULL, 'PIMPINAN DAERAH MUHAMMADIYAH KOTA BANDUNG; Ketua: RIFQI ALI MUBARAK, S.Ag., M.Si', 'PIMPINAN DAERAH MUHAMMADIYAH KOTA BANDUNG TAHUN 2017', 'Permohonan Dana Muhammadiyah Mencerahkan Bandung Berkemajuan Tahun 2017;\nPeningkatan dan pengembangan sistem gerakan,sumberdaya manusia dan amal usaha yang unggul dan mandiri bagi terciptanya kondisi dan faktor-faktor pendukung terwujudnya masyarakat Islam yang sebenar-benarnya.', 'Peningkatan dan pengembangan gerakan menuju Muhammadiyah yang mencerahkan bBandung Berkemajuan.', 'Jl. Kadipaten Raya No.4-6 Antapani Bandung; \nTelp: 022-7272951', 'f5bf894bd12123c89e3da3ec3354be2b.pdf', NULL, NULL, 1, 12, '2016-03-28 17:00:00', NULL, 6),
(690, 2, NULL, 'YAYASAN AL-AMANAH BUAH BATU; MASJID AGUNG BUAH BATU BANDUNG;  Ketua: H.MOCH. RACHMAT DINNAR', 'YAYASAN AL-AMANAH BUAH BATU TAHUN 2017', 'Permohonan Bantuan Dana untuk penyelesaian pembangunan gedung pendidikan madrasah Tahun 2017;\nPerekonomian warga masyarakat dilingkungan sekitar kebanyakan ekonomi menengah kebawah,sehingga kemampuan untuk mendapatkan pendidikan baik umum maupun agama angat terbatas.', 'Nenfasilitasi sarana dan prasarana penyelenggaraan pendidikan TKA dan pendidikan madrasah anak-anak santriwan dan santriwati prasekolah dan bermoral islam.', ' Jl. Margacinta No.90 Bandung;\nTelp: 022-7567554', '218877c4d756a1db43b3768bb1488e77.pdf', NULL, NULL, NULL, NULL, '2016-03-29 17:00:00', NULL, NULL),
(691, 2, NULL, 'DPC LSM KOMUNITAS PEDULI RAKYAT (LSM-KPR);  Ketua: Drs. St. RUDOLF MANURUNG', 'Permohonan Bantuan Dana untuk kegiatan Penyuluhan/Sosialisasi tentang Bahaya dan akibat menkonsumsi Narkoba', 'Penyalahgunaan narkoba pada akhir tahun ini dirasakan semakin meningkat.dapat kita amati dari pemberitaan-pemberitaan baik dimedia cetak maupun elektronika yang hampir setiap hari memberitakan tentang penangkapan para pelaku penyalahgunaan narkoba oleh aparat keamanan,', 'Merumuskan model pemberdayaan pranata sosial dalam menangani masalah penyalahgubaan narkoba.Manfaat yang diharapkan adalah sebagai bahan masukan bagi perumusan kebijakan penanganan masalah pendayagunaan narkoba khususnya keikutsertaan pencegahan dan penanganan penyalahgunaan masalah narkoba.', ' Jl. Pelindung Hewan No.25 Bandung;\n Telp: 022-5206986/081322482353;', 'a30074b4e3f7e4a00274b48db480b31e.pdf', NULL, NULL, NULL, NULL, '2016-03-30 17:00:00', NULL, NULL),
(692, 2, NULL, 'YAYASAN PENDIDIKAN ISLAM (YPI) MULTAZAM MUHAMMAD YUSUF SYA''RONI-LEMBAGA KESEJAHTERAAN SOSIAL ANAK (LKSA) MULTAZAM; Ketua: FATHURROHMAN, SE', 'YAYASAN PENDIDIKAN ISLAM (YPI) MULTAZAM MUHAMMAD YUSUF SYA''RONI-LEMBAGA KESEJAHTERAAN SOSIAL ANAK (LKSA) MULTAZAM TAHUN 2017', 'Permohonan Bantuan Dana Hibah APBD Kota Bandung Tahun 2017 untuk biaya operasional panti;\nLembaga kesejahteraan Sosial Anak (LKSA) Multazam Putra-Putri berdiri tahun 1989 yang pada awalnya beralamat di jl.sekeloa utara no.79 Bandung,maka sesuai dengan perkembangan dan terutama makin bertambahnya jumlah anak asuhan asrama panti asuhan Multazam bandung berpindah ke jalan padasuka No,88 Bandung.', 'Untuk memberikan pelayanan pengganti dan pemenuhan kebutuhan fisik,mental dan sosial serta untuk penyantun dan pengasuh anak dari keluarga tidak mampu atau terlantar dikarenakan sebab-sebab lain dari usia SMP,SMA sampai usia perguruan tinggi.', 'Jl. Padasuka No.88 Bandung; \nTelp: 022-7206411/081322414003;  ', 'd53ab0ace8a6c8a0c8966590942b5ee5.pdf', NULL, NULL, 1, 13, '2016-03-30 17:00:00', NULL, 6),
(693, 2, NULL, 'MAJELIS ULAMA INDONESIA (MUI) KOTA BANDUNG; Ketua: Prof. DR. KH. MIFTAH FARIDL', 'MAJELIS ULAMA INDONESIA (MUI) KOTA BANDUNG TAHUN 2017', 'Permohonan Bantuan Dana Hibah  untuk Pelaksanaan Program MUI Tahun 2017;\nPokok-pokok pengembangan program ini disusun untuk memberikan arah kebijakan kepada pengurus MUI Kota Bandung periode 2016-2021 dalam mencapai tujuan utama organisasi yakni,1. mengupayakan terbentuknya umat yang berkulitas dan memiliki ahlak mulia. 2.Mewujudkan kemampuan ekonomi umat yang kuat. 3. Membangun iklim sosial yang sehat lahir maupun bathin.', 'Untuk mencapai sasaran utamnya meningkatkan pemahaman.penghayatan dan pengamalan ajaran Islam dikalangan umat khususnya dikota Bandung sesuai dengan arah perubahan dan kecenderungan masyarakat setempat.', 'Jl. Terminal Sadang Serang No. 13 Bandung; \nTelp: 022-2502149;', '93ab408597ef399b37b27b7b95dfb907.pdf', NULL, NULL, 1, 12, '2016-04-03 17:00:00', NULL, 6),
(694, 2, NULL, 'YAYASAN PENDIDIKAN NURUL HUDA-MADRASAH IBTIDAIYAH NURUL HUDA;  Ketua: H. WARIN WARDANY', 'YAYASAN PENDIDIKAN NURUL HUDA-MADRASAH IBTIDAIYAH NURUL HUDA TAHUN 2017', 'Permohonan Bantuan Pembangunan MI Nurul Huda Lantai II;\nPendidikan merupakan usaha sistematik pewaris budaya oleh masyarakat kepada generasi penerus..Pada saat ini lembaga sekolah masih merupakan media yang dianggap paling aktif untuk usaha pewaris budaya massal,khususnya pewaris pengetahuan dan teknologi.', 'MI Nurul Huda telah merencanakan beberapa fasilitas penunjang yang diharapkan dalam waktu dekat bisa terwujud diantaranya: Pembangunan Ruang kelas baru untuk pengembangan bidang pendidikan Sarana dan prasarana.', ' Jl.Sindangsari No.137 Kel. Cipadung Kulon Kec. Panyileukan Kota Bandung; \nTelp: 081312626383;', '7a57418523800cc8d0695cfd41f3b545.pdf', NULL, NULL, NULL, NULL, '2016-04-04 17:00:00', NULL, NULL),
(695, 2, NULL, 'YAYASAN NURUL IHSAN;  Ketua: Dr.Sc.agr.H.YUDI NURUL IHSAN', 'YAYASAN NURUL IHSAN TAHUN 2017', 'Permohonan Bantuan Dana Hibah ABPD 2017 untuk operasional yayasan;\nDalam era modern dimana pengasuhan,pendidkan,kesehatan dan pemerataan pembangunan adalah syarat penting yang harus dipenuhi untuk mewujudkan masyarakat sejahtera, mahalnya biaya hidup dan tidak meratanya pembangunan telah menciptakan tingginya tingkat pengangguran sehingga banyak generasi penerus di usia produktif tidak mendapatkan pengasuhan,pendidikan,kesehatan yang layak.', 'Turut serta membantu program pemerintah dalam meningkatkan kesejahteraan masyarakat dan mengatasi kemiskinan,Mencerdaskan kehidupan bangsa, usaha kesehatan dan peningkatan gizi masyarakat.', 'Jl. Mekar Manah No.7 Cijerah Bandung;\nTelp: 022-6010939;', 'd93ae11410d2d535043e6274a3486283.pdf', NULL, NULL, 1, 13, '2016-04-10 17:00:00', NULL, 6),
(696, 2, NULL, 'PERSATUAN WREDATAMA (Pensiunan Sipil) REPUBLIK INDONESIA (PWRI) CABANG KOTA BANDUNG; Ketua: IBIN SUHANA', 'PERSATUAN WREDATAMA (Pensiunan Sipil) REPUBLIK INDONESIA (PWRI) CABANG KOTA BANDUNG TAHUN 2017', 'Permohonan Bantuan Dana Operasional PWRI Cabang Kota Bandung Tahun 2017;\nSehubungan dengan usia organissi PWRI sudah menginjak 52 tahun maka dirasa perlu adanya dukungan dari pemerintah daerah masing - masing dimana organisasi PWRI itu berada,sesuai dengan surat edaran Menteri Dalam Negeri Nomor 485.1/SJ tanggal 10 Juni 20008 yang Isinya agar pemerintah daerah mendukung kegiatan PWRI di daerah masing-masing.', 'Menjalin silaturahmi sesama anggota PWRI, PWRI dan Lembaga-lembaga lainnya. Memelihara,menigkatkan kesehatan dan kebugaran para wredatama untuk mencapai peningkatan kualitas hidup.', 'Jl. Terusan Jalan Diponegoro/Muararajeun Lama No.68 S/144 E; \nTelp: 022-7237339; ', '587c148bcb6e40bf558c6355c3c5ceba.pdf', NULL, NULL, 1, 4, '2016-04-10 17:00:00', NULL, 6),
(697, 2, NULL, 'DINAS KESEHATAN ANGKATAN UDARA - RSAU dr. M. SALAMUN; Ketua: dr. BAMBANG S GUNADI, SpRad, MARS', 'DINAS KESEHATAN ANGKATAN UDARA - RSAU dr. M. SALAMUN TAHUN 2017', 'Permohonan Bantuan Pembangunan/Restorasi Gedung Rawat Jalan/Poliklinik RSAU dr.MSalamun ;\nSelain melaksanakan tugas pokok dalam hal dukungan kesehatan kepada anggota TNI AU juga telah melakukan pelayanan kesehatan kepada anggota TNI dan keluarganya serta masyarakat umum diwilayah kota Bandung pada khususnya dan masyarakat Jawa Barat pada umumnya bekerja sama dengan BPJS kesehatan,BPJS tenaga kerja dan Dinas Kesehatan Kota Bandung.', 'Untuk meningkatkan kualitas pelayanan kesehatan bagi masyarakat kota Bandung pada khususnya dan masyarakat Jawa Barat pada umumnya serta untuk menjalin kemitraan antara Rumah Sakit TNI (RSAU dr.M Salamun) dengan Pemerintah Daerah dalam ragka mendukung Visi,Misi Pemerintah Kota Bandung.', 'Jl. Ciumbuleuit No. 203 Bandung; \nTelp: 022-2032090, 022-2031624;', 'ee644d4d6ca96ce26fc094c84c87e289.pdf', NULL, NULL, NULL, NULL, '2016-04-10 17:00:00', NULL, NULL),
(698, 2, NULL, 'YAYASAN VIDIA ISWARI; Ketua: VIDIA ISWARI, S.Sn', 'YAYASAN VIDIA ISWARI TAHUN 2017', 'Permohonan Bantuan Dana Hibah 2017 untuk Sarana & Prasarana Yayasan;\nYayasan Vidia Iswari Bandung telah berpengalaman melaksanakan berbagai macam pelatihan serta pertunjukan seni tradisi yang tentunya didukung oleh Pemerintah,swasta maupun lembaga asing lainnya seperti USAID dan UNDP Program yang telah kami laksanakan mendapatkan penghargaan sebagai "The Best Practice Program"', 'Berperan aktif dalam membina,mengembangkan serta melestarikan seni tradisi Sunda Khususnya,Indonesia pada umumnya. Meningkatkan peran serta pemuda untuk berkontribusi pada sektor ekonomi melalui penciptaan lapangan pekerjaan dibidang industri seni yang dikelola secara profesional. ', '; Jl. Cijawura Girang V Suminta No. 1 Bandung; \nTelp: 022- 7563778/081809071980;', '51214d4bbb25074b159f93ceaf7d3073.pdf', NULL, NULL, 1, 17, '2016-04-19 17:00:00', NULL, 6),
(699, 2, NULL, 'YAYASAN PEMBERDAYAAN UMMAT-COMMUNITY RECOVERY FOUNDATION; Ketua: INDRADJIT PANDJISENA', 'YAYASAN PEMBERDAYAAN UMMAT-COMMUNITY RECOVERY FOUNDATION TAHUN 2017', 'Permohonan Bantuan Biaya Operasional, Keterampilan dan Rekreasi bagi Panti Asuhan Pemberdayaan Ummat Tahun 2017; Hingga saat ini Yayasan Pemberdayaan Umat melalui panti Sosial Asuhan Anak (PSAA) Pemberdayaan umat mengasuh sebanyak 77anak,26 dalam panti 51 santunan keluarga di 2 asrama.', 'Meningkatkanmutu kelembagaan dan kinerja organisasi sosial. Meningkatkan mutu pelayanan kesejahteraan sosial garapan Yayasan Pemberdayaan Umat.', ' Jl. Suniaraja Gg. Apandi No.74/II A Rt.03 Rw.04 Kel. Braga Kec. Sumur Bandung Kota Bandung dan \nJl. Cigagak No.6 Rt.01 Rw.15 Kel. Cipadung Kec. Cibiru Bandung; \nTelp : 022-87827041/08122350634;', 'f43a1726eea1e12c82716a4cb4721a2c.pdf', NULL, NULL, NULL, NULL, '2016-04-20 17:00:00', NULL, NULL),
(700, 2, NULL, 'YAYASAN AZ-ZAMANIYAH; Ketua: KIKI KOMARUZAMAN, S.Pd.I', 'YAYASAN AZ-ZAMANIYAH TAHUN 2017', 'Pembangunan Madrasah Az-Zamani Yayasan Az-Zamaniyah Tahun 2017;\nSejalan dengan perkembangan jaman dan pendidikan di negara indonesia,serta dengan mengamati situasi dan kondisi negeri ini, dimana peningkatan intelektual dan keterampilan generasi penerus bangsa yang masih perlu ditingkatkan,serta pengembangan kepribadian dan prilaku kebangsaan serta pembenahan moral pemerus bangsa yang bertolak ukur pada sektor agama.', 'Membangun Gedung Madrasah yang permanen dan reprtesentatif sesuai dengan standar kelayakan untuk dipergunakan sebagai sarana kegiatan belajar mengajar yang aman dan anyaman.', ' Alamat Mekar Jati Rw.05 Kel. Pasir Biru Kec. Cibiru Kota Bandung;\n telp: 081323665111', 'a7e2bde7553983ffb73f63fe5a94fd6b.pdf', NULL, NULL, NULL, NULL, '2016-04-21 17:00:00', NULL, NULL),
(701, 2, NULL, 'YAYASAN MIFTAHUT TAUFIQ;  Ketua: K.AHMAD SOLIHIN', 'YAYASAN MIFTAHUT TAUFIQ TAHUN 2017', 'Permohonan Bantuan Dana Hibah TA 2017 untuk pembangunan sarana & prasarana serta operasional organisasi ; Perwujudan dan pengembangan nilai-nilai keikhlasan beribadah kepada Allah SWT melalui Dakwah Bil-Haal dan bil-Maal disatu pihak,sedangkan pihak lain tetap terjalin ukhuwah islamiyah diantara kaum muslimin baik yang berada dilingkungan pesantren maupun yang berada diluar pesantren.', 'Membangun gedung Madrasah yang permanen dan representatif sesuai dengan standar kelayakan untuk dipergunakan sebagai sarana kegiatan belajar mengajar.Mengembangkan potensi pendidikan yang berdaya saing.', 'No.18 Kel. Pasir Biru Kec. Cibiru Bandung; \nTlp: 081221457062; ', '0575f41df2ee0c9045791be97cc1a1a0.pdf', NULL, NULL, NULL, NULL, '2016-04-24 17:00:00', NULL, NULL),
(702, 2, NULL, 'YAYASAN PENDIDIKAN ISLAM (YPI) ABDURROHMAN AHMAD NASUTION; Ketua: ELIS AMINAH', 'YAYASAN PENDIDIKAN ISLAM (YPI) ABDURROHMAN AHMAD NASUTION TAHUN 2017', 'Permohonan Bantuan Dana Hibah TA 2017 untuk pembangunan Sekolah Raudhatul Athfal Abdurrohman;\nUntuk dapat terlaksananya pembangunan sekolah Raudhatul Athfal Abdururrohman dengan kerendahan hati kami sangat mengharapkan bantuan untuk pembangunan sekolah.', 'Meningkatkan kualitas sarana dan prasarana pendidikan agar mutu pembangunan sumber daya manusia dapat ditingkatkan.', ' Jl. A.H. Nasution Kp. Kertasari Rt.05/07 Kel. Karang Pamulang Kec. Mandalajati Bandung; \ntelp: 081321713013; ', 'ef7d0db498db9bd2693bf31f144a53a8.pdf', NULL, NULL, NULL, NULL, '2016-04-26 17:00:00', NULL, NULL),
