(705, 2, NULL, 'YAYASAN AL-MAHABBAH BINA UMAT;Ketua: OJIM, M.Ag', 'YAYASAN AL-MAHABBAH BINA UMAT TAHUN 2017', 'Permohonan Bantuan Dana Hibah 2017 untuk Pembangunan Lantai II Masjid Al-Mahabbah, \nDikarenakan masjid Al-Mahabbah kurang memadai sedangkan jamaah banyak terutama pada bulan suci Ramadhan,kami merencanakan untuk membangun lantai II sebagai sarana peningkatan kualitas hubungan dengan Allah AWT dan hubungan sosial dengan masyarakat.', 'Memelihara dan meningkatkan kualitas kecintaan,keimanan dan ketaqwaan kepada allah SWT.\nmensyiarkan dan mengembangkan agama Islam.', '; Alamat: Jl. Terusan Panyileukan Belakang No.11 SMP Al-Biruni Rt.05 Rw.01 Kel. Cipadung Kec. Panyileukan Kota Bandung; \nTelp: 085220892641/081320452306; ', '7df589b098acf84411ca72ce7f726609.pdf', NULL, NULL, NULL, NULL, '2016-05-09 17:00:00', NULL, NULL),
(706, 2, NULL, 'FORUM KERUKUNAN UMAT BERAGAMA (FKUB) KOTA BANDUNG;Ketua: Dr. H. AHMAD SUHERMAN, MPd', 'FORUM KERUKUNAN UMAT BERAGAMA (FKUB) KOTA BANDUNG TAHUN 2017', 'Dalam rangka kelancaran pemantapan kerukunan umat beragama tersebut sangat dibutuhkan adanya penunjang disamping sumber daya manusia yang sudah ada.', 'Terwujudnya masyarakat Bandung Agamis yang mampu mensinergikan trilogi kerukunan hidup umat beragama menuju bandung kota jasa yang bermartabat.', 'Alamat: Jl. Dalem Kaum No.56 Pendopo Kota Bandung; \nTelp: 022-4262445;', '89dfffcdb5297757f518abe632125e4c.pdf', NULL, NULL, 1, 12, '2016-05-12 17:00:00', NULL, 6),
