(708, 86, NULL, 'Karang taruna Setha Bhakti Unit 10', 'Usaha Ekonomi Produktif', '            Karang Taruna “SETHA BHAKTI” UNIT RW10 yang terletak di Kel.Cigending Kec.Ujungberung Bandung ini memiliki berbagai permasalahan sosial, karena banyaknya pemuda pengangguran yang perlu untuk segera di atasi. Namun dikarenakan keterbatasan jangkauan penanganan oleh pemerintah, maka Karang Taruna “SETRA BHAKTI” UNIT RW10 memiliki pemikiran guna membantu pemerintah dalam mengatasi permasalahan tersebut. Hal ini sejalan dengan amanat UU No 11 Tahun 2009 tentang Kesejahteraan Sosial, dan menurut PERMENSOS 77/HUK/2010 tentang pedoman dasar Karang Taruna, disebutkan bahwa TUJUAN KARANG TARUNA adalah :\n1.	Mewujudkan pertumbuhan dan perke,bangan masyarakat (khususnya generasi muda) yang berkualitas, trampil, cerdas, inovatif,  berkarakter serta memiliki kesadaran dan tanggung jawab sosial dalam mencegah, menangkal, menanggulangi, dan mengantisipasi masalah Kesos.\n2.	Mewujudkan kualitas kesehjateraan sosial masyarakat secara terarah, terpadu, menyeluruh dan berkelanjutan pengembangan usaha menuju kemandirian masyarakat.\n3.	Pengembangan kemitraan yang menjamin peningkatan kemampuan potensi generasi muda secara terarah.\n             Guna memenuhi cita-cita luhur tersebut, maka Karang Taruna “SETHA BHAKTI” UNIT RW10 mengajukan permohonan usaha ekonomis produktif berupa USAHA SABLON DIGITAL.\n', '            Maksud permohonan bantuan ini untuk mendukung pembiayaan kegiatan Karang Taruna “SETHA BHAKTI” UNIT RW10  dengan mmalui usaha ekonomi produktif berupa USAHA SABLON DIGITAL Tujuan :\n1.	Untuk meningkatan kesejahteraan Karang Taruna “SETRA BHAKTI” unit RW10 melalui usaha ekonomis produktif berupa tersebut sebagai salah satu sarana mendukung kelancaran pelaksanaan tugas Karang Taruna.\n2.	Menumbuhkan dan meningkatkan jiwa kewirausahaan di kalangan warga karang taruna.\n3.	Meningkatkan jiwa sosial antar sesama.\n            Kondisi di wilayah banyak pemuda yang berpotensi menjadi seorang pengusaha, tapi karena keterbatasan modal dan sedikitnya lapangan pekerjaan yang ada , menjadikan pemuda di wilayah kami pengangguran.\n            Disamping potensi tersebut, di wilayah kami juga memiliki permasalahan yang memerlukan perhatian khusus . Antara lain kurangnya tempat untuk menyalurkan bakat kreatif mreka dan banyak pemuda pengangguran yang menyebabkan kmiskinan. Dari permasalahan tersebut kami bermaksud untuk turut serta  penanganan sesuai dengan kemampuan. Diantaranya kami ingin menangani masalah untuk penyaluran bakat kreatif para pemuda, mengurangi pengangguran, dan kemiskinan di wilayah kami. \n', 'Cijambe Jln.Marta no 34 rt03/rw10 Kel.Cigending Kec.Ujungberung Bandung', '808186410fcb8a94ed11095fd3e145a2.pdf', NULL, NULL, NULL, NULL, '2016-08-04 04:54:08', NULL, NULL),
(709, 88, NULL, 'Madrasah Al-Hidayah', 'PROPOSAL PENYELESAIAN PEMBANGUNAN MADRASAH AL-HIDAYAH', 'Keinginan kami untuk menyelesaikan Pembangunan Madrasah Al-Hidayah yang sudah tertunda selama 2 tahun akibat kekurangan dana, saat ini bangunan tinggal 40 % lagi untuk selesai 100%', 'a.	Maksud\nMadrasah sebagai tempat belajar para santri di Madrasah Al-Hidayah ini sudah tidak memadai lagi maka kami bermaksud merenovasi Madrasah yang telah ada.\n\nb.	Tujuan\n1.	terciptanya kondisi belajar mengajar yang nyaman guna meningkatkan kualitas pembelajaran yang diharapkan;\n2.	meningkatkan kepedullian kaum muslimin dan muslimat terhadap sarana pendidikan dalam rangka syi’ar Islam;\n3.	sebagai wadah penyiaran sodaqoh demi syi’ar Islam.\n', 'Jl. Madesa No. 2 RT. 07 RW. 12 Kelurahan Kopo Kecamatan Bojongloa Kaler', 'e3f1d627d9b5a829de6334b19b9b3012.pdf', NULL, NULL, NULL, NULL, '2016-08-05 02:41:55', NULL, NULL),
