(711, 90, NULL, 'KELOMPOK USAHA SAUYUNAN MANDIRI (KUSM)', 'BANK SAMPAH', 'Bank Sampah merupakan konsep pengumpulan sampah kering dan dipilah serta memiliki manajemen layaknya perbankan tapi yang ditabung bukan uang melainkan sampah. Warga yang menabung yang juga disebut nasabah memiliki buku tabungan dan dapat meminjam uang yang nantinya dikembalikan dengan sampah seharga uang yang dipinjam.Sampah yang ditabung ditimbang dan dihargai dengan sejumlah uang nantinya akan dijual di pabrik yang sudah bekerja sama.', 'Maksud dan Tujuan dibangunnya bank sampah sebenarnya bukan bank sampah itu sendiri. Bank sampah adalah strategi untuk membangun kepedulian masyarakat agar dapat ‘berkawan’ dengan sampah untuk mendapatkan manfaat ekonomi langsung dari sampah. Jadi, bank sampah tidak dapat berdiri sendiri melainkan harus diintegrasikan dengan gerakan 4R sehingga manfaat langsung yang dirasakan tidak hanya ekonomi, namun pembangunan lingkungan yang bersih, hijau dan sehat.', 'JL. SRIWIJAYA BABAKAN PRIANGAN NO. 96 RT. 09/01\nKEL. CISEUREUH KEC. REGOL KOTA BANDUNG ', 'baee3db179bdc6b8d45effbac38a359c.pdf', NULL, NULL, NULL, NULL, '2016-08-16 09:47:50', NULL, NULL),
