(721, 7, NULL, 'FORUM SILATURAHMI ORMA ISLAM KOTA BANDUNG (FSOI) - KETUA - Drs. H. UGAS RAHMANSYAH, M.AP.', 'FORUM SILATURAHMI ORMA ISLAM KOTA BANDUNG (FSOI) TAHUN 2017', 'Forum Silaruraluni ormas lslam .Kota Bundung merupakan gabungan organisasi- \norganisasi di Islam Kota Bandung terdiri dari Nahdatul Ulama, Muhammadiyah, \nPersis, Syarikat Islam, Al Washliyah, Al Irsyad, Matlaul Anwar, PU I Perri, Parmusi, \nDMI, Al-Manar, FUI, JV[DJ, DDII, ICML bertujuan untuk mcmpererat silaturahmi dan \ndan hannonis khususnya dikalangan onnas Islam umumnya dengan komponcn\ndalam mcnyiarkan syi''ar ]slam di kota Bandung sehingga tercipta suasana yang rukun\nkerjasama dalam mencgakan amar ma''ruf nabyr munkar serta saling bahu mernbahu \nmasyarakat lain yang berbeda aqidah sepanjaug tidak merugikan Islam maka FSOJ \nsenautiasa mengadakan hubungan baik dan kerjasarna dalam pernbinaan kernkanan \nantar ummat beragama khususnya dalam kegiatan kemasyarakatan yang bersifat \numum Firman Allah SWT. "Da11 l11mdaklah ada sekelompok orang ytmg menyeru \nkepatfa kebaikan, menyruh kepada ya11g ma''rup dun meucegalt kemungkaran, don \nmereka itulah orang-orang yang beruntung" (QS.AJ-lmron 104) ', '"Memperkokoh dan meurpererat tali Silaturahim antar Ormas Islam sebingga tercipta \nkcrukunan dan kebersamaan ummat Islam kota Bandung agar masyarakat kola ', 'Jl. Ibrahim Adie No. 82 Kiaracondong Bandung', NULL, NULL, NULL, 1, 12, '2016-06-16 17:00:00', NULL, 7),
(722, 7, NULL, 'POLRESTABES BANDUNG KEPALA KEPOLISIAN RESOR KOTA BANDUNG : KOMBES WINARTO', 'POLRESTABES BANDUNG KEPALA KEPOLISIAN RESOR KOTA BANDUNG TAHUN 2017', 'Program Peogembangan Strategi Keamanan Ketertiban, Program Patensi Keamanan, Program Harkamtibmas, Program PenyeUdikan dan Penyidikan Tindak Pindana di wllayah hukum Polrestabes Bandung Tahun 2017', 'Maksud : permohonan Hibah inl adalah untuk menunjang peningkatan Tupoksi Polrestabes Bandung selain dari sumber DIPA Rutin guna menjawab persoalan yang dihadapi masyarakat kota Bandung khususnya dibidang permasalahan lalu lintas dan gangguan kriminalitas dan juga melibatkan berbagai komponen system pengamanan yang saling terkait satu sama lain.\nTujuannya : adalah untuk menciptakan rasa aman masyarakat Kota Bandung terhadap segala bentuk gangguan kamtibmas dan kamtibcar lantas. \n', 'Jl.  Merdeka 18-20  Bandung', 'ca296eed4db3de032d60e38fae3655fa.pdf', NULL, NULL, 1, 20, '2016-06-15 17:00:00', NULL, 7),
(723, 7, NULL, 'KOMISI  PEMILIHAN  UMUM KOTA BANDUNG - KETUA : RIFQI ALIMUBAROK', 'KOMISI  PEMILIHAN  UMUM KOTA BANDUNG TAHUN 2017', '-', '-', 'JI. Soekarno-Hatta  No. 260  Kel. Sekejati Kee. Buah  Batu Kota Bandung; Telp:  022-7506654-\n0818422735', 'a8d9985a4b9e1fc5c95d73a2d64d4b13.pdf', NULL, NULL, 1, 4, '2016-03-22 17:00:00', NULL, 6),
(724, 7, NULL, 'PIMPINAN CABANG LEGIUN VETERAN REPUBLIK INDONESIA KOTA BANDUNG - KETUA - H SUDIRMAN', 'PIMPINAN CABANG LEGIUN VETERAN REPUBLIK INDONESIA KOTA BANDUNG TAHUN 2017', '-', '-', 'JI.  Aceh No.  4 Bandung; Telp: 022-4239430', 'c041569acc80dbcab8dc9b7371ff4dc5.pdf', NULL, NULL, 1, 4, '2016-05-22 17:00:00', NULL, 7),
(725, 7, NULL, 'POLISI MILITER DAERAH MILITER III/SILIWANGI DETASEMEN POLISI MILITER III/5 - DANDENPOM III/5 BDG POMDAM III/SLW - Letkol Cpm DIDIN SOFYANNADIN', 'POLISI MILITER DAERAH MILITER III/SILIWANGI DETASEMEN POLISI MILITER III/5 (DENPOM) TAHUN 2017', 'Program Kerja Polisi Militer Daerah Militer III/Siliwangi Detasemen Polisi Militer III/5 Tahun 2017', 'Untuk terciptanya stabilitas keamanan yang kondusif dan hubungan yang harmonis antara Denpom III/5 Bdg selaku aparat kewilayahan TNI AD dengan Pemerintah Kota Bandung sehingga dapat mencegah segala ancaman, gangguan, hambatan dan tantangan yang mungkin timbul di wilayah Kota Bandung.', 'Jl. Jawa No. 11 Bandung / Jl. Basuki Rahmat No. 30  Kel. Sumur Batu Kec. Teluk Betung Utara Bandar Lampung -  No. KTP : 1871991368730002', '0d96b82ddca32edd9c3e9c1603ecdf94.pdf', NULL, NULL, 1, 4, '2016-06-14 17:00:00', NULL, 6),
(726, 7, NULL, 'KODIM 0618/BS BANDUNG - DANDIM 0618/BS – Letkol. SUGIYONO', 'KODIM 0618/BS BANDUNG TAHUN 2017', 'Program Kerja Kodim 0618/BS Bandung Tahun 2017', 'Untuk melengkapi sarana penunjang kerja anggota staf Kodim 0618/BS, memelihara bangunan bersejarah (Heritage) Kodim 0618/BS Kota Bandung dan memelihara sarana dan prasarana satuan guna memaksimalkan kinerja satuan', 'Jl. Bangka No.2 Rt.05 Rw.05 Kel.Merdeka Kec.Sumur Bandung Kota Bandung', 'cf026056532f6f2772332e22b524ed41.pdf', NULL, NULL, 1, 9, '2016-06-16 17:00:00', NULL, 6),
(727, 125, NULL, 'cahya (individu)', 'Re-coloring Bandung', 'Kota Bandung menurut saya memiliki fasilitas-fasilitas yang cukup baik, entah itu fasilitas yang baru maupun fasilitas yang lama. Akan tetapi fasilitas tidak didukung dengan adanya management yang baik, entah itu pembersihan atau perawatan dari fasilitas itu sendiri.\n\nMelihat itu saya sendiri tergerak membuat project di Kota Bandung dengan melibatkan mahasiswa/i atau generasi muda dalam pelaksaan project ini. Bukan hanya akan memberikan pengalaman / experience kepada mahasiswa, juga secara tidak langsung akan menanamkan nilai bahwa fasilitas Bandung harus dijaga agar sehingga fasilitas di Kota Bandung bisa mengerluarkan fungsinya yang daripada mana adalah mempercantik Kota Bandung.\n\nIde ini saya dapat saat saya pergi ke Jl. Leuwipanjang, disana saya melihat suasana jalan Leuwipanjang sangat berdebu dan tidak enak untuk dipandang. Dan yang menarik perhatian saya adalah pembatas jalan yang terbuat dari tiang-tiang panjang di sepanjang jalan Leuwipanjang. Fasilitas pembatas jalan tersebut warnanya sudah kabur dan tidak menarik untuk dilihat.\n\nDan menurut saya, dengan mulai hal kecil seperti mewarnai dan membersihkan area pembatas jalan tesebut akan membawa citra baru di Jl Leuwipanjang. Dari saat itu saya mulai memperhatikan fasilitas yang ada di Kota Bandung, dan beberapa fasilitas Kota Bandung perlu perawatan.\n', 'Sasaran untuk project ini adalah sebagai pemicu untuk mulai membuat fasilitas kota Bandung menjadi berwarna dan membuat Bandung menjadi kota yang bersih.\n\nMahasiswa/i atau generasi muda, dan masyarakat sekitar yang melihat kita melakukan project recoloring. \n\nMahasiswa yang terlibat akan membagikan pengalamannya dalam project ini kepada mahasiswa lain, dan memotivasi mahasiswa lain agar menjaga fasilitas kita bersama.\n\nSedangkan untuk masyarakat, mereka setidaknya akan mulai berfikir bahwa membuang sampah / atau merusak fasilitas umum bukanlah hal baik. \n', 'jl babakan tarogong no 85', 'a7a31fde75e8a270a7810e13ec3c18b4.pdf', NULL, NULL, NULL, NULL, '2016-10-25 03:21:04', NULL, NULL),
(728, 7, NULL, 'PIMPINAN  DAERAH MUHAMMADIYAH KOTA BANDUNG - KETUA - RIFQIALI MUBARAK, S.Ag.,  M.Si', 'PIMPINAN  DAERAH MUHAMMADIYAH KOTA BANDUNG TAHUN 2017', 'Peningkatan dan pengembangan sistern gerakan, sumberdava manusia, dan amal\nusaha yang unggul dan mandirf bagi terciptanya kondisi dan faktor-faktor pendukung \nterwujudnya masyarakat Islam yang sebenar-benarnya. serta peningkatan dan\npengembangan peran strategis Muhamrnadiyah dalam kehidupan umat. bangsa, dan \ndlnamika global.', '1. Peningkatan dan pengembanga n geral<an menu ju Munammadiyah yang mcncerahkan\nBandung berkemajuan. \n2.2. Peningkatan dan pengembangan organisasi dan jaringan untuk menjadi gerakan Islam\nyang maju, profeslonal. dan modern: ', 'Jl.  Kadipaten Raya  No.4-6 Antapani\nBandung; Telp:  022-7272951', 'e747a9bbc4c44204a47e82eb04deb6e7.pdf', NULL, NULL, 1, NULL, '2016-03-28 17:00:00', NULL, 1),
(729, 7, NULL, 'LEMBAGA PENGEMBANGAN TILAWATIL QUR''AN (LPTQ) KOTA BANDUNG - KETUA - Drs.H.DIDING, M.Ag', 'LEMBAGA PENGEMBANGAN TILAWATIL QUR''AN (LPTQ) KOTA BANDUNG TAHUN 2017', '-', '-', 'Jl.  Soekarno\nHatta  No.498 Tlp.022-7505925', '510596a3dbf7bfa23d2fe1e702bb2503.pdf', NULL, NULL, 1, NULL, '2016-06-15 17:00:00', NULL, 1),
(730, 7, NULL, 'DPC LSM KOMUNITAS PEDULI RAKYAT(LSM-KPR) - KETUA - Ors. St. RUDOLF MANURUNG', 'DPC LSM KOMUNITAS PEDULI RAKYAT(LSM-KPR) TAHUN 2017', 'Narkotika, psikotropika dan zat adiktif lainnya (NAPZA) yang blasa disebut narkoba merupakan\njenis obat/zat yang dfperlukan di dafam dunia pengobatan. Akan tetapi apabila dipergu nakan \ntanpa pernbatasan dan pengawasan yang seksama dapat menimbulkan ketergantungan serta\ndapat membehayakan kesehatan bahkan jiwa pemakainya . ', '- Maksud : \nSosialisasi yang akan dladakan lni agar calon-calon pemimpin bangsa dan negara \nterdnta rernmdar dari kerusakan otak atau berfildr aldb·at menggunakarr narkoba dan\nse;enisnya, sehingga kecerdasannya terganggu/rusak, soslalisasf dan penyuluhan ini sangat \nbermanfaat untuk anak-anak bangsa, demi masa depan anak bangsa dan bangsa Indonesia\ntercinta inl. \n- Tujuan :\nTujuan darl penyuluhan ini adalah terumuskannya model pemberdayaan pranata sosial dalam \nmenangani masalah penyalahgunaan narkoba. Manfaat yang diharapkan adalah sebagal\nbahan masukan bagi perumusan kebijakan penanganan masalah penyafahgunaan narkoba \nkhususnya kelkutsertaan pencegahan dan penanganan penyalahgunaan masatah narkoba,\nserta memberikan pernanaman kepada stswa-stswt SMA, rrrasyarakat dan Pemud''a'' tentang \nbahaya narkoba. ', '.  Pelindung Hewan  No.25 Bandung; Telp: 022-5206986/081322482353', 'f9e34f95ace4c3baffaf1052d8f40f99.pdf', NULL, NULL, 1, NULL, '2016-03-30 17:00:00', NULL, 1),
(731, 7, NULL, 'KOMANDO INVESTIGASI & OBSERVASIRI - LSM PENYELENGGARAN MISSI NEGARA RI - KETUA - AGUS MANSJURSJAH, SMHK', 'KOMANDO INVESTIGASI & OBSERVASIRI - LSM PENYELENGGARAN MISSI NEGARA RI TAHUN 2017', 'Aknvitas kami tahun 2.016,tentang penanggnlangan kriminalitas di Kota Bandung. Menurut basil observasi tahun 2011-2016,bcrbagai aksi krimiual  di Kola Bandung dan di berbagai daerah di seluruh Jawa Barat.terus meningkar dan telah cukup unluk disimpulkan sebagai sebuah ancaman.atas keuyamanan dan atas keselamatan publik, ', '-', 'Jl. Gempol Kulon  No.81 Bandung; Telp: 08886216626', 'a018eb4032266a4d0113f673e9dc9aa7.pdf', NULL, NULL, 1, NULL, '2016-05-17 17:00:00', NULL, 1),
(732, 7, NULL, 'FORUM KEWASPADAAN DINI MASYARAKAT KOTA BANDUNG - KETUA - AHMAD SOLEH', 'FORUM KEWASPADAAN DINI MASYARAKAT KOTA BANDUNG (FKDM) TAHUN 2017 - TAHUN 2016 SUDAH DAPAT', 'Sebagai pemegang amanah kedaulatan rakyat. pemerintah darl lingkup pusat hmgga daerah  sangat diharapakan untuk selalu responsif terhadap dinamika perkembangan yang terjadl, dalam kaitan lni pemerintah memerlukan adanya lembaga yang dapat selalu cepat mengetahul permasalanan vang terjadi. Untuk itu Forum Kewaspadaan Dini M2syarakat ( FKDM ) dspat menjadi salah satu unsur yang dapat berperan aktif dalam mengantisipasi perkembangan dan permasalahan yang ada dan melalui aktlvitas kajiannya diharapkan dapat memberikan masukan pada unsur pimpinan dalam penetapan kebijakan dan langkah tindakan. terutama dalam mengetasl permasalahan yang ada, ', 'Tujuan dari Forum Kewaspadaan Dini Masyarakat ( FKDM ) Daerah Kota Bandung ialah\ncfeteksl dlni segala kemungkinan Ancaman, Tantangan, Hambatan dan Gangguan (ATHG) \nyang ~apat mempengaruhl ''!;tabilltas IPOLEKSOSBUDHANKAM di Kota Bandung. Misalnya: \nancaman tercrisme, ekstrim kanan, ekstrim kiri, dislntegrasi bangsa, tsu sara, aliran sesat, \n~onflik kesgamaan dan masalah masalah sosial lainnya dan dengan adanya deteksl din! ini \nmak~ dlharapkan berbagai hal tersebut tidak terjadi. ', 'Jl.Gudang  Utara No.18 Kelurahan Merdeka Kecamatan Sumur Bandung', '89a2b6014807d7551ca4c6d9babc8966.pdf', NULL, NULL, NULL, NULL, '2016-06-16 17:00:00', NULL, NULL);
