(733, 7, NULL, 'KOMANDO OPERASI TNI ANGKATAN UDARA I PANGKALAN TNI AU HUSEIN SASTRANEGARA, KOMANDAN LANUD HUSEIN SASTRANEGARA - KETUA - KOLONEL Y. ADITYA PERMANA', 'KOMANDO OPERASI TNI ANGKATAN UDARA I PANGKALAN TNI AU HUSEIN SASTRANEGARA, KOMANDAN LANUD HUSEIN SASTRANEGARA TAHUN 2017', 'Pangkalan Udara Husein Sastranegara yang yang merupakan Lantid Tipe B\nyang bertugas menyiapkan dan melaksanakaan pembinaan dan pen!J)perasian\nseluruh satuan dalam jajarannya, pembinaan potensi dirgantara sena\nmenyetenggarakan dukungan operasi bagi satuan lainnya. Lokasinya yang sangat \nsbategis sebagai wilayah penyangga lbukota negara RI, memiliki peran yang \nsangat penting dilihat dari berbagai aspek baik aspek pertahanan keamanan, \nekonomi maupun sosial budaya. Sesuai deogan talaran kewenangannya\nPangkalan Ud.3ra Husein Sastranegara telah melakukan berbagai kegiatan melalui\nkoordinasi dengan pemerintah daerah, instansimliter, instansi terkait lainnya serta \ndeogan masyarakat sekitar l..anud. Hal tersebut dilakuk.an dalam berbagai bidang \ndiantaranya bidang pembinaan dan pemt>erdayaanan segenap sumber daya \nnasional yang dapat ditransformasikan meojadi satuan-satuan komponen kekuat.an\npertahanan negara. ', ' Maksud : untuk menunjang tugas pokok Lanud Husein Sastranegara untuk meningkatkan\npengamanan objek vital nasional dari juga meningkatkan pembinaan potensi dirgantara \nT ujuannya adalah untuk menciptakan rasa aman di wilayah\nTujuan : untuk menciptakan rasa aman di wilayah Lanud Husein Sastranegara dari segala bentuk ancaman serta meningkatkan minat dirgantara', 'Jl. Husen Sastranegara Bandung', '847445d599f32bcdda2e7dca70061600.pdf', NULL, NULL, 1, NULL, '2016-06-19 17:00:00', NULL, 1);
